eval("module.exports = [{\"title\":\"这部新剧，就像是谢耳朵的前传\",\"content\":[{\"para\":\"《非典型孤独》：谁的生活不曾经历过困惑、颠簸和解脱\"},{\"para\":\"又怪异又治愈。这就是《非典型孤独》给人们最直观的感受。你很难说这部美剧讲述了什么，即便它似乎有一个清晰的主题，一个患有“高能自闭症”的 18 岁男孩儿遭遇了自己的青春期。有关自闭症和孤独症的美剧并不鲜见，但大都悲戚或者悲壮，而《非典型孤独》却无底线无节操地耍贫，充满讽刺和揶揄，到处夹杂着有关性的段子，看到最后，却慢慢地发现，某些温热的东西开始在心中流淌，那些满不在乎和调侃其实才是真正的尊重，从而把那个自闭症的孩子剔除了患者身份，他不过就是个普通人，偶尔说点怪话，时不时造成点尴尬，可想想，谁又不是如此呢？大家都有病，不是吗？\"},{\"para\":\"如果非要找个熟悉的美剧类比，那么或许可以把《非典型孤独》理解为《生活大爆炸》中的谢耳朵的“前传”，确实，这故事里的男主角萨姆，怎么看怎么像谢耳朵——与世俗格格不入，一身怪癖，极端聪明、执着又呆萌，对人情世故一窍不通，对男女关系懵懵懂懂。\"},{\"para\":\"萨姆到了 18 岁，仍然清瘦，孤僻，不敢与人直视，只有一个朋友，热爱谈论南极洲和企鹅，饲养一只乌龟，努力接受心理治疗，被焦虑的父母环绕，被疼爱他的妹妹照顾。可他毕竟也在长大，终于一头撞上了每个人都躲不开的青春期。他寻找爱情，获得爱情，被爱情伤害，也伤害他人。当然，他在遭遇了性，这个普通人都难以捉摸的东西，对于萨姆来说，更加麻烦，它成为了一种催化剂，让他长大，认识自己，面对自己，接受自己，更重要的是，他在经历了一切混乱之后，似乎在一点点摆脱那些与生俱来的症状，慢慢地融入人群。\"},{\"para\":\"这部美剧穿插着大量的独白和呓语，这个苍白的男孩儿自顾自地念叨着所有想法，他的不解，他的迷惑，他的希冀，他的愤怒，他的欲望，这样一来，一切都变得有趣起来，或许，我们可以换一个视角去注视这个困惑的男孩儿，通常意义上讲，他是一名患者，他无法藏住心里的想法，无法像绝大多数人那样沟通，比如，他不懂得暗示，不明白委婉，别人都觉得他难以招架，只有他那个善良的女友觉得这是坦诚，她对他说，“我爸妈不在家，你或许可以过来找我。”但萨姆不太理解这其中的奥妙，去问他的朋友——一个自以为风流倜傥的 geek，对方告诉他，那是暗示他有关性的事情。\"},{\"para\":\"于是，萨姆就当着所有同学的面去问那个女孩，她到底是不是这个意思。这样令人尴尬的事有很多，但时间久了，这些原本啼笑皆非的尴尬却生发出另一种情境和反问，所有人，所有“正常人”，每天拐弯抹角，似是而非，人们封闭自己的想法，隐瞒真实的内心，然后说出某些让彼此觉得得体的语言，维系一种虚假的关系。这算不算一种“症状”？从这个意义上说，萨姆作为一个自闭症患者，对于周遭世界的深深的不解，却变成了一种独特的对比，它得以让人们反问自己，自己是不是每天也都陷于某种意义上的荒诞与虚妄。长久以来，我们的视角都被固定在“大多数”和“正常人”的身份中，对于萨姆这样的人，无非是猎奇和讪笑的态度，但时间久了，却发现，自己身上需要被讪笑的内容并不比那个“病人”要少几分。\"},{\"para\":\"这个故事的成功在于，它并没有只聚焦于这个“患者”，萨姆是主角，但不是绝对的主角，换句话说，他并不是一切，即便他的家庭因为他的特殊情况，不得不做出应对，但家庭成员中的每个人也都在处理着自己的生活以及自己的困惑。萨姆像一面镜子，折射出这个家庭成员中每个人的内心。\"},{\"para\":\"从外部去观察，从整体上做判断，这是个其乐融融的家庭，除了萨姆，他们还有一个努力上进，聪明漂亮的女儿。作为女儿，作为妹妹，凯西一直觉得自己的这个家庭普通也令人安慰，但很快，她就意识到这个家庭并非没有裂痕，比如，她后来才知道，自己小时候，父亲曾经离家出走了一段时间，只不过日后所有人对此都闭口不提罢了。当父亲发现自己的儿子永远不可能像其他孩子那样与自己亲密相处，和自己嬉笑打闹，那种难以名状的压力和绝望足以撕裂所有人，所以，他的离家出走无法用道德判词进行指控。这个悲戚又绝望的部分，在故事中是以短暂的背景出现的，由此，在向人们提示，这个故事也在慢慢地转换视角，镜头从对男孩儿萨姆的注视，缓缓摇移到每一个家庭成员的脸上。\"},{\"para\":\"爸爸走过了那段不堪，如今变成了一个笨拙又本分的男人，而妈妈，却在默默经历着一场悄然而至的中年危机。她最重要的角色，其实不只是母亲和妻子，还是儿子的“护士”和“陪伴者”，但有一天，儿子突然告诉他，他应该自己去买衣服，而不是再穿妈妈随便买来的 T 恤，对于母亲而言，孩子的长大，是心绪复杂的过程，不只是欣慰，还有恐慌，自己满腔热忱被抽空了释放地点，自己的意义被突然取缔，她存在的价值还剩什么？为孩子筹备一场 party，为闺蜜们做做头发，还有，就是去参加和维系那一场场自闭症儿童妈妈的聚会，彼此诉苦，赞叹，鼓励和互相八卦，除此之外，她的生活就只剩下去面对巨大的空洞。\"},{\"para\":\"未能免俗，她选择了一场婚外情作为填补空洞的捷径，那是一个和他们的生活完全相悖的男人，她所在的那个中产家庭，谨慎又妥善，总是充满计划，但那个酒保，只活在当下，他成为了一个绝望主妇生活中的强心针。故事至此，人们就会明白，每一个人都在微笑的脸和假装不在意的轻松姿势背后，努力挣扎。女儿在权衡，一边是更好的高中，一边是自己友谊和刚刚展开的爱情；萨姆的那个心理医生，表面上看起来对一切尽在掌握，但实际上，自己的感情也一触即溃……更不要提萨姆自己，一边在和疾病缠斗，一边开始对青春中突然来临的爱与性的本能不知所措。有个爱他的女孩，他却觉得自己爱上了心理医生，又或者，他根本不知道到底什么是爱情。\"},{\"para\":\"你看，所以说，这根本不是一个区隔了常人和病人的故事，这故事里的每个人都在破碎，而每个人都在重组。人们都遇到了生活里的一段颠簸，每个人都在寻求一种妥善的方式试试到底该如何度过。总体上说，这是一个温情脉脉的故事，它用一种自嘲和幽默的轻拿轻放的姿态呈现了原本可以想见的凝重主题，无法摆脱的怪异疾病、中年危机和青春困惑，还有那些永恒的困境，性与爱该如何处理，人和人又该保持怎样的距离，家庭成员之间如何可以让彼此不被熟悉窒息又不让彼此疏离。生活轻巧地为人们设下严酷的谜题，我们只能遍寻谜底。\"},{\"para\":\"萨姆在经历了摸索，探求，挣扎，尝试以及经受过伤害和被伤害之后，最终慢慢变得柔和，他脱去了帽衫，穿上了一件礼服，和女友敞开心扉，他似乎懂得了爱情和生活到底包含着怎样的意义，即便那感受朦胧又模糊。但是，谁不都是如此吗？谁能说得清爱情的形状，谁能描摹出生活的轮廓。你看着萨姆一点点敢于和人直视，看着他一点点能够明白旁人的感受，就会明白，那是一种怎样美妙的变化。萨姆不只是一个病人，他也是我们每一个人的缩影。谁的生活不曾经历过困惑，颠簸和解脱。\"},{\"para\":\"（本文首发《北京青年报》）\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"- 哆啦 A 梦啊，我熟啊\\n- 那它一共变过几次画风，你说说看？\",\"content\":[{\"para\":\"很多读者经常分不清两位藤子老师的差别，所以先科普一下藤子不二雄笔名的由来：“藤子不二雄”这个笔名，代表了藤子 · F · 不二雄（藤本弘）和藤子不二雄 A（安孙子素雄）两个作者。二人从少年时代就是好友，并共用“藤子不二雄”这个笔名创作了《Q 太郎》等一系列经典漫画。然而随着时间的推移，二人在题材、画风上的差异也越来越大。于是在 1987 年，二人决定拆伙，并分别使用藤子 · F · 不二雄和藤子不二雄 A 的笔名（下文用 F 先生和 A 先生代替）继续创作。\"},{\"para\":\"\"},{\"para\":\"▲藤子不二雄组合，左为 F 先生，右为 A 先生。\"},{\"para\":\"哆啦 A 梦初次连载是在 1970 年 1 月的《小学 1-4 年级生》上，而两位老师分道扬镳是在 1987 年，因此从时间上看，A 先生有可能以帮忙的形式参与了哆啦 A 梦前期个别画面的绘制。（需要指出的是，在《哆啦 A 梦》开始连载时，两位老师已经开始分别创作自己的作品。而且《哆啦 A 梦》的版权完全属于 F 先生，并没有像两位老师共同创作的《小鬼 Q 太郎》版权由双方共有，所以故事的创作应该是 F 先生独立完成的，详细经过请参考 @Cristaldo 在高赞答案下的回复）\"},{\"para\":\"接下来我们将从三个方面讨论两位老师笔下哆啦 A 梦的差异：一、F 先生画风的演变；二、A 先生画风的特点；三、哆啦 A 梦中可能由 A 先生执笔的部分。（想看结论的同学可以直接跳到第三部分）\"},{\"para\":\"一、F 先生画风的演变\"},{\"para\":\"《哆啦 A 梦》漫画从 1970 年开始连载到 1996 年 F 先生去世，横跨了 26 个年头。由于同时在《小学一年生》~《小学六年生》上连载，其覆盖的年龄层也非常广泛。这就导致了 F 先生笔下的哆啦 A 梦，在不同的年代、面对不同的读者群体时，画风也会有非常大的差异。所以，为了将两位作者的画风区分开，我们首先要了解 F 先生画风的演变。\"},{\"para\":\"\"},{\"para\":\"▲哆啦 A 梦和大雄画风的变化。分别出自漫画第 1 卷《从未来之国千里迢迢而来》和漫画第 41 卷《我是迷你哆啦 A 梦》。\"},{\"para\":\"从上面的对比中可以看出早期的哆啦 A 梦身材丰满，头小身子大，比较符合不倒翁的形象（哆啦 A 梦的灵感来源于不倒翁）。而后期的哆啦 A 梦则明显消瘦了许多，看来照顾大雄还真的是一份很辛苦的工作（笑）。需要指出的是，F 先生最早是准备把哆啦 A 梦作为一部搞笑漫画的，所以早期的哆啦 A 梦总是糊里糊涂，动作和表情也比较蠢萌。\"},{\"para\":\"\"},{\"para\":\"▲早期稀里糊涂的哆啦 A 梦，出自大全集第 2 卷《机器人喀嚓子》。哆啦 A 梦和机器鸭喀嚓子为了争夺照顾大雄猜拳，结果把大雄摔到了地上。\"},{\"para\":\"而随着故事发展人物不断丰满，加上《哆啦 A 梦》这部作品本身也承载了越来越多的内涵，后期就不太容易看到哆啦 A 梦这种“冒傻气”的表情了。另一个从内而外发生变化的就是胖妹，早期的胖妹完全就是邻家熊孩子的形象，而后期就演变成一个为梦想奋斗的女孩子了。\"},{\"para\":\"\"},{\"para\":\"▲胖妹的蜕变，从熊孩子到追求梦想的新人漫画家。分别出自漫画第 1 卷《从未来之国千里迢迢而来》和漫画第 29 卷《漫画家胖妹老师》。\"},{\"para\":\"“五人组”中的另外四位——大雄、静香、胖虎、小夫，身材从三头身变得更加修长，同时人物的线条更加干脆利落。这种画风上的变化在 F 先生的另一部代表作《小超人帕门》中体现得也非常明显。\"},{\"para\":\"\"},{\"para\":\"▲大雄和朋友们的画风对比。分别出自漫画第 1 卷《古董大战》和第 41 卷《我是迷你哆啦 A 梦》。\"},{\"para\":\"\"},{\"para\":\"▲《小超人帕门》画风对比。分别出自单行本漫画第 2 卷和第 6 卷。前后两次连载相隔大约十五年。\"},{\"para\":\"\"},{\"para\":\"▲《小超人帕门》的男主角须羽光夫和女主角星野堇。分别出自单行本漫画第 1 卷和第 7 卷。\"},{\"para\":\"《哆啦 A 梦》的画风除了会随着时间不断进化之外，还会根据读者的年龄层次进行调整。大雄上小学四年级的设定，其实是在漫画单行本发布之后才统一的。在漫画的连载过程中，大雄是和读者同一个年级的。也就是说，在《小学一年生》上的大雄就是一年级，而《小学六年生》上的大雄则是六年级。为了照顾读者，低年级杂志上的故事相对简单易懂，人物形象也比较贴近小朋友，有时甚至还会标注出漫画的阅读顺序。\"},{\"para\":\"\"},{\"para\":\"▲面向低年级的《哆啦 A 梦》漫画。出自大全集第 1 卷《棒球大骚动》。\"},{\"para\":\"\"},{\"para\":\"▲低龄向的漫画还会标注阅读顺序。出自大全集第 2 卷《百发百中枪》。\"},{\"para\":\"综上所述，F 先生在《哆啦 A 梦》漫画中的画风变化主要体现在两个方面：一是随着时间推移画风不断改进，人物造型变得干脆利落；二是面向不同年龄段的读者作出的画风上的调整。了解 F 先生的画风演变，有助于我们有效区分两位作者风格上的不同。\"},{\"para\":\"二、A 先生画风的特点\"},{\"para\":\"与 F 先生相比，A 先生在中国的名气相对要小一些。其实 A 先生也是一位非常高产的作者，代表作品有《怪物太郎》、《忍者服部君》（大陆翻译《小忍者》）、《职业高尔夫选手猿》、《笑面推销员》等，这些漫画也都曾被改编成动画搬上荧幕。\"},{\"para\":\"\"},{\"para\":\"▲《怪物太郎》。在哆啦 A 梦第 32 卷《万能机场》中客串。\"},{\"para\":\"\"},{\"para\":\"▲《忍者服部君》。吉林美术出版社版本为《小忍者》，在哆啦 A 梦第 28 卷《忍术修炼》中作为大雄看的漫画客串过。\"},{\"para\":\"\"},{\"para\":\"▲《剧画 毛泽东传》。前些年被网友翻出，在互联网上突然火了一把的漫画。\"},{\"para\":\"\"},{\"para\":\"▲《笑面推销员》。丧黑大叔的邪魅一笑被称为四月新番中的一股清（níshí）流，其实这部漫画已经是第二次动画化了。\"},{\"para\":\"看过 A 先生的漫画作品，你会发现他的画风具有非常强烈的个人风格：\"},{\"para\":\"1.烘托诡异气氛的背景以及在人物面部大量运用的光影。\"},{\"para\":\"与热衷 SF 题材的 F 先生不同，A 先生的作品具有强烈的魔幻风格，故事情节曲折离奇，经常让人猜不透后续的发展。而对于人物性格中阴暗的一面，A 先生也常常是毫不避讳，反而将其变形、夸张后展示出来。这样的故事风格也直接影响了 A 先生的画风。\"},{\"para\":\"\"},{\"para\":\"▲出自漫画《神奇魔童》。为了烘托出紧张的气氛，在分镜背景中使用明暗强烈对比的色调。背景中大量曲线元素的使用以及人物脸部的阴影，反映出了人物内心微妙的变化。\"},{\"para\":\"\"},{\"para\":\"▲出自《笑面推销员》（丧黑大叔又在坑人了……）。背景和人物面部的阴影和上面异曲同工。\"},{\"para\":\"2.人物的面部特征\"},{\"para\":\"A 先生笔下人物的眼睛，在紧张、激动或者愤怒的时候，会呈现出一种特有的“D”形。\"},{\"para\":\"\"},{\"para\":\"▲平时圆眼睛的怪物太郎，生气时眼睛就会变成这种形状。\"},{\"para\":\"\"},{\"para\":\"▲《忍者服部君》，服部君的父亲醉酒前 VS 醉酒后。\"},{\"para\":\"甚至一些人物在设定的时候时眼睛就是这种形状（女性居多），而 F 先生笔下的美女基本上都长着一副静香脸，眼睛是椭圆形。这也是两位老师区别非常明显的一点。\"},{\"para\":\"\"},{\"para\":\"▲《忍者服部君》女一号梦子（右一）、服部君的弟弟心藏（右三）还有主人公健一的妈妈（图中未出现）的眼睛都是这种形状。\"},{\"para\":\"\"},{\"para\":\"▲F 先生笔下的女主角，清一色的静香脸。\"},{\"para\":\"在五官的画法上，A 先生与 F 先生另一处显著差异体现在牙齿上。F 先生笔下的人物通常是“笑不露齿”，开心的时候往往不露出牙齿，只有在坏笑或者生气的时候牙齿才会被描绘出来。相比较之下，A 先生笔下的人物有更多的机会秀出一口好牙：紧张、心虚、愤怒、甚至“皮笑肉不笑”时都有可能露出牙齿。\"},{\"para\":\"\"},{\"para\":\"▲F 先生笔下的人物，坏笑或者愤怒时会露出牙齿。两格均出自《哆啦 A 梦》漫画第 27 卷《胖虎、小夫乖宝宝》。\"},{\"para\":\"\"},{\"para\":\"▲A 先生给“露出牙齿”这个动作赋予了更多的含义。上面几格分别出自《怪物太郎》、《忍者服部君》、《神奇魔童》、《笑面推销员》。\"},{\"para\":\"嘴型方面，除去小夫和服部君这种设定就是尖嘴的人物之外，两位老师的画法上还是有诸多相似之处的。总体来说，A 先生的画法相对没那么圆润，有时人物会出现尖嘴。但后期差异就不是很明显了。\"},{\"para\":\"3.线条和笔触\"},{\"para\":\"这其实是漫画家个人的习惯和爱好决定的。与 F 先生相比，A 先生的漫画通常线条更粗。而且 A 先生有时会在人物轮廓和细节上使用两种粗细不同的线条：外部轮廓用粗线条，细节的描绘用细线条。这一点从前面的几个例子中也能看出来。\"},{\"para\":\"三、《哆啦 A 梦》中可能由 A 先生执笔的部分\"},{\"para\":\"前面啰嗦了那么多两位老师的画风问题，下面就让我们进入猜想的环节，看一看有哪些部分出自 A 先生之手。\"},{\"para\":\"1. 《一辈子一次的一百分》 疑似指数：★★☆☆☆\"},{\"para\":\"出自漫画第 1 卷《一辈子一次的一百分》。这个故事的知名度很高，一方面是因为神奇的道具电脑铅笔，和任意门、时光机这些神器一起，长年霸占小朋友最想拥有的道具前几名。另一方面是在粉丝群体的讨论中，这个故事塑造出的诡异气氛，在哆啦 A 梦全部漫画中作品中也能排进前几名。而这些“诡异”的气氛，又集中体现在下面这几格中：\"},{\"para\":\"\"},{\"para\":\"阴险的胖虎，失望的哆啦 A 梦，还有内心挣扎的大雄。强烈的明暗对比以及人物脸上的阴影，都让我们有理由相信出自擅长黑暗故事的 A 先生之手。不过由于人物画风是标准的 F 先生风格，所以疑似指数只有两颗星。\"},{\"para\":\"2.《诅咒照相机》 疑似指数：★★★☆☆\"},{\"para\":\"如果说前面那个故事可以排进哆啦 A 梦最诡异故事的前几名，那么出自漫画第 4 卷的《诅咒照相机》绝对有实力竞争哆啦 A 梦最恐怖故事的头把交椅（另一个是第 8 卷的《人类制造机》）。这个故事的恐怖氛围全部来自道具“诅咒照相机”，试想如果在现实生活中出现这样可以随意将他人火烤、针扎、折磨的道具……好在哆啦 A 梦是一部面向少年的漫画，不会出现过于重口的情节，但也并不防止这个故事成为尺度最大的哆啦 A 梦漫画之一。（如果成年人拿到了这个道具会怎么样？F 先生在异色短篇集中做了探讨，感兴趣的读者可以找来看一看）\"},{\"para\":\"\"},{\"para\":\"在这个故事中，大雄和哆啦 A 梦的表情和动作非常夸张。而 “诅咒照相机”登场以及快门按下一瞬间的画面，都具有十足的张力和压迫感。这些表现手法在哆啦 A 梦全部漫画中出现的次数非常少，又和 A 先生的作品有相似之处，因此我们有理由相信 A 先生参与了这个故事的创作。\"},{\"para\":\"3.没有机关的魔术 疑似指数：★★★★☆\"},{\"para\":\"\"},{\"para\":\"出自大全集第 2 卷《没有机关的魔术》。这两格中大雄“霸道总裁范”的表情，再也没有在其它故事中出现过。从嘴型还有表情中透露出的情绪来看，更像 A 先生作品中的人物。顺带一提，这个故事中大雄妈妈的外形也发生了很大的变化。\"},{\"para\":\"最后还有一个不在《哆啦 A 梦》故事中，A 先生可能参与的故事：《世界上尽是谎言》，出自《小超人帕门》漫画第 2 卷。疑似指数：★★★★★\"},{\"para\":\"\"},{\"para\":\"人物的眼睛和嘴都是标准的 A 先生画风。而当小超人帕门再次连载时，相同的人物在 F 先生笔下是这样的：\"},{\"para\":\"\"},{\"para\":\"上面的这些比较，更多的是基于个人的猜测。F 先生于 1996 年溘然长逝，A 先生如今也年事已高，很多关于两位老师早期的合作还有幕后的故事我们都不得而知。但是我们依然要像藤子 · F · 不二雄和藤子不二雄 A 两位老师致意，有了他们的创作，我们的童年才能如此丰富多彩！\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"都说多吃鱼会又白又聪明，但我……算了，好吃就行了\",\"content\":[{\"para\":\"看我知乎昵称就知道，我是爱吃鱼的，水煮鱼，酸菜鱼，清蒸，红烧都喜欢。\"},{\"para\":\"收藏比点赞多一半，这是什么鬼啊，得点赞鼓励一下小伙子，才有动力更新菜谱啊！\"},{\"para\":\"煎鱼不破皮的技巧，一是保证鱼身没有水，可以用厨房纸吸干，二是鱼下锅后绝对不能翻动，三是用一片姜片涂抹锅底。前面两点是最重要的。\"},{\"para\":\"翻看了相册，发现我有几道鱼的做法，就来献丑了……\"},{\"para\":\"- 多图预警，看完后你会饿，切勿深夜观看 -\"},{\"para\":\"水煮鱼\"},{\"para\":\"作为一个广东人，其实很少吃辣的，唯独这水煮鱼欲罢不能。在外面吃，又怕底料用几次，于是自己在家学着做，味道还不错，麻辣嫩滑的鱼片，刺激着味蕾。\"},{\"para\":\"材料，草鱼，我自己一个人能吃一斤的草鱼。\"},{\"para\":\"花椒，干辣椒，豆瓣酱，八角，香叶，胡椒粉，鸡蛋，淀粉，姜蒜。\"},{\"para\":\"配菜看你自己喜欢的下，我放了豆芽和莴笋\"},{\"para\":\"很多人问切鱼片的方法，网上找了一张切鱼片的方法。起鱼片刀要锋利，有一定的刀工。\"},{\"para\":\"\"},{\"para\":\"将鱼起片，买鱼的时候，可以叫老板帮弄好，我是自己回家起的，怕买鱼的切不均匀。\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"鱼片里放进胡椒粉，鸡蛋只要鸡蛋清，倒进鱼片里，淀粉用水冲成粘粘的淀粉水，也倒进鱼片里\"},{\"para\":\"一起用手搅拌均匀静置腌制。\"},{\"para\":\"\"},{\"para\":\"干辣椒切块，喜欢吃更辣的可以加点小米辣，香叶八角，豆瓣酱一起放锅里炒香，锅里的油要多一点。\"},{\"para\":\"\"},{\"para\":\"爆炒后加水熬制，可以放进鱼骨头一起熬，10 分钟左右。\"},{\"para\":\"\"},{\"para\":\"用另外的锅烧水把配菜烫一下，6 成熟就好，想偷懒也可以直接在熬汤的锅里烫。\"},{\"para\":\"\"},{\"para\":\"鱼片用另外的锅，烧水烫熟，水开 10 秒就熟。当然，想方便也可以直接用汤底煮，但是我怕水淀粉影响汤底就另煮了。\"},{\"para\":\"\"},{\"para\":\"煮好放盘子里，把熬制好的烫一起倒进盆子里。\"},{\"para\":\"\"},{\"para\":\"最后，放一点姜碎，蒜蓉，葱花和干辣椒粉。锅里烧热油，倒上去。你会听到滋滋的声音。\"},{\"para\":\"\"},{\"para\":\"大功告成，色香味俱全……\"},{\"para\":\"\"},{\"para\":\"一个人能把整条鱼吃光，实在太嫩滑了。\"},{\"para\":\"\"},{\"para\":\"香煎金鲳鱼\"},{\"para\":\"这一道菜有点类似红烧。\"},{\"para\":\"材料很简单，金鲳鱼，姜蒜，辣椒，盐油。\"},{\"para\":\"金鲳鱼买回来，先划上几刀，放点盐腌制几分钟。\"},{\"para\":\"\"},{\"para\":\"锅里放油，放一点盐，放一块姜片涂抹锅底，听说能防破皮。下鱼煎，鱼一定弄干水，不然也会破皮，下鱼后，不要翻动，就能保持鱼的卖相。\"},{\"para\":\"\"},{\"para\":\"两面煎至金黄，就下姜片蒜，还有酱油，加一点水煮。\"},{\"para\":\"\"},{\"para\":\"煮大概 5 分钟就能熟悉，最后 1 分钟大火收汁，放上辣椒丝装饰即可。\"},{\"para\":\"\"},{\"para\":\"清蒸鲈鱼\"},{\"para\":\"广东人最喜欢清蒸，能最大限度保证鱼的鲜味，清蒸我喜欢用鲈鱼和罗非鱼，鲈鱼肉质鲜嫩，但是价格比较贵，罗非鱼，泥土味比较重，但是骨头很少，而且价格便宜。\"},{\"para\":\"材料是，鲈鱼，姜，大蒜，蒸鱼豉油，料酒，盐油。\"},{\"para\":\"首先盘子下面，放一点姜片和大蒜\"},{\"para\":\"\"},{\"para\":\"鲈鱼中间开一刀趴下，放盐料酒腌制放上盘，鱼上面再放姜丝和大蒜丝。\"},{\"para\":\"\"},{\"para\":\"入锅，大火蒸 8 分钟即可。\"},{\"para\":\"\"},{\"para\":\"出锅，把盘子里的汁倒掉，这汁很腥的。淋上蒸鱼豉油，放上葱丝。锅里放油，烧开后淋上鱼。\"},{\"para\":\"\"},{\"para\":\"美味嫩滑的清蒸鲈鱼即可上桌。\"},{\"para\":\"\"},{\"para\":\"红烧鲤鱼\"},{\"para\":\"有的人感觉清蒸无味，香煎太容易上火。那么红烧一定符合他的口味。皮脆肉嫩的红烧鱼，加上一点汁，非常下饭。\"},{\"para\":\"买的鱼太大，锅太小，太难煮了。\"},{\"para\":\"材料，鲤鱼，黄豆酱，蚝油，料酒，青红辣椒，姜，猪肉丁。\"},{\"para\":\"首先将鱼划刀放盐腌制。\"},{\"para\":\"\"},{\"para\":\"入锅煎至两面金黄。步骤跟香煎金鲳鱼一样的。\"},{\"para\":\"\"},{\"para\":\"把鱼倒出碟，锅里用剩下的油把肉丁，姜片黄豆酱，葱头一起爆香。\"},{\"para\":\"\"},{\"para\":\"锅太小，我换了一个锅焖煮。爆香后把鱼放进去，然后放水焖，水量大概淹没半个鱼身，放一点蚝油。盖上盖子中火煮 8 分钟左右。\"},{\"para\":\"\"},{\"para\":\"把青红辣椒切成圈圈，在最后一分钟放进，并大火收汁。\"},{\"para\":\"\"},{\"para\":\"美味的下饭菜。\"},{\"para\":\"\"},{\"para\":\"最后一道是汤。\"},{\"para\":\"鲫鱼豆腐汤。\"},{\"para\":\"奶白色的汤很鲜甜。\"},{\"para\":\"材料，鲫鱼，豆腐，姜，葱，鸡精，油盐。\"},{\"para\":\"前面煎鱼的步骤跟香煎金鲳鱼是一样的。\"},{\"para\":\"鱼身划刀上盐腌制。\"},{\"para\":\"\"},{\"para\":\"热锅下油爆姜，然后，煎鱼\"},{\"para\":\"\"},{\"para\":\"煎至两面金黄即可。\"},{\"para\":\"\"},{\"para\":\"换深一点的锅熬汤，不用换也行，但是我怕水溅出就换了。倒下开水，大火熬汤。听人说用开水煮汤才会变奶白。葱打结放下去。\"},{\"para\":\"\"},{\"para\":\"大火煮 10 分钟后，下豆腐中火 5 分钟。\"},{\"para\":\"\"},{\"para\":\"最后出锅\"},{\"para\":\"\"},{\"para\":\"这汤真的像牛奶一样白。\"},{\"para\":\"\"},{\"para\":\"烤箱爆烤鱼\"},{\"para\":\"很久之前做的，没拍过程，下次做再更新。\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"先介绍这几道菜，下次有新做法再更新。\"},{\"para\":\"多点吃鱼，人会变聪明变白，家里老人家说的，可是我那么喜欢吃还是那么黑那么……不说了，都是泪啊。\"},{\"para\":\"吃鱼的时候，注意骨头就是了……\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"夜跑有哪些注意事项？\",\"content\":[{\"para\":\"不请自来，夜跑族，请容我回答。\"},{\"para\":\"首先首先，夜跑最最重要的一点，反光带！鞋子上，裤子上，衣服上，头带上，腿上，身前，身后，能有的地方尽量有，生命在于运动，生命都不顾了，还哪来生命跑步，你说是不是。\"},{\"para\":\"咳咳，进入正题吧：\"},{\"para\":\"- 跑前 -\"},{\"para\":\"1、 计划当晚的路线，路程，服装，鞋子，可能预知的天气，跑前餐，备注\"},{\"para\":\"路线：选车流少的道路，一般城市有公园自行车专用道一直沿着江边，可以折返跑。\"},{\"para\":\"周末白天可以晨跑，去跑未知的路线，熟悉后可以制定晚上跑步路线，省心省事最主要安全。\"},{\"para\":\"安全：女生尽量不要跑黑暗地方，尽量有男生陪同。\"},{\"para\":\"路程：根据自身身体素质来制定，一般要有所预留，因为累了的话你一停下来就不想跑了\"},{\"para\":\"服装：夏天，怎么舒服怎么来\"},{\"para\":\"冬天，保暖最重要，可以穿着紧身衣紧身裤外加皮肤风衣，半指手套，长筒袜子收在裤腿外 面保暖。衣服吸汗性透汗性一定要好，不然出了汗一直憋在后背，等跑完那个凉爽……\"},{\"para\":\"腰带，可以放很多东西，诸如散钱，手机，钥匙，巧克力，纸巾\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"鞋子：一般夜跑都是跑公路，你什么什么脚型就穿什么对应功能的鞋，胖的人容易受伤就穿包裹性好的，平足倾向支撑型跑鞋，正常的就选择正常跑鞋。\"},{\"para\":\"（美津浓官网上右边有个脚型测试的，可以上去测试后再考虑你要选取的鞋。Mizuno Precision Fit Online Shoe Finder）\"},{\"para\":\"前面这个网站挂了，我重新补上一个可以用的：Mizuno Precision Fit Online\"},{\"para\":\"希望没耽误各位！囧 rz=З\"},{\"para\":\"鞋子后跟磨损严重就换了吧，对你脊椎有害，姿势变形就容易对身体造成伤害，花点钱买双好的，穿起来舒服，跑起来安心啊。跑群有位小伙伴，穿着那双磨得鞋跟都平了的鞋子不舍得换，非要等到双十一再买，这好，珠海马拉松回来脚底伤了，至少要一年恢复，直接废了，所以这点切记。\"},{\"para\":\"可能预知的天气：大风天和下雨天就休跑，膝盖淋雨可不是什么好玩的，不管夏天冬天，跑完不要立马脱衣服，慢慢凉下来就可以，可以走走，放松放松，不要站着不动，也不要赤膊，入风了以后可是会很难受的。\"},{\"para\":\"跑前餐：不要油腻，不要吃撑，不要饿着肚子，其余怎么吃就这么吃。我一般是红薯加玉米杂粮类，晚上很少吃米饭，跑前吃一根香蕉，会有想不到的效果。休息时间休息至少 40 分钟，我是一个小时。\"},{\"para\":\"备注：如果你觉得跑时会饿可以带着糖果巧克力这些补充\"},{\"para\":\"- 跑时 - \"},{\"para\":\"1， 热身很重要，跑前一定一定要热身啊各位亲，不然你的膝盖，你的脚底板，就很可能提早的出现状况，到时想跑都没得跑了,冬天一定要活动好膝盖，因为膝盖最难预热，你也可以前面的路程慢慢跑，等热身开了再用自己配速跑，我一般前三公里是热身，后面才按自己配速跑。\"},{\"para\":\"2， 一般跑步运动的话时间控制在 90 分钟内就 OK 了，最好买块计时手表，有配速有心率那种，配速观察自己速度是否匀速，心率留意自己心跳，超过一定值就要小心了，别硬撑，容易出事。最大心率范围把握在 220- 年龄 次 / 分 内\"},{\"para\":\"3， 一般有氧跑怎么把握，你觉得你边跑步还能边和旁边的人聊天就是有氧，当你觉得呼吸急促肌肉有灼烧感的时候就是无氧了\"},{\"para\":\"4， 跑步姿势，这点得请行家来看，因为你自己是看不出你跑步姿势的正确与否\"},{\"para\":\"5， @万畅 的 NIKE+ 跑步软件不错，推荐用。我就是这个，可以记录你所有的跑量，配速，距离，温度，还有报时，GPS 定位。还可以拉上小伙伴一起，有好友功能，大家共同监督共同成长\"},{\"para\":\"6，呼吸，均匀。提速时乱了呼吸就深呼深吸，鼻子吸，口呼，呼吸深一点，不能急。出现横膈膜痛就适当减速，深呼吸调整，慢慢就会好了。总之就是不能急。\"},{\"para\":\"7，下坡，注意别伤着膝盖了。坡陡一点就稍微侧着身子，手臂放到后边缓冲一下\"},{\"para\":\"8，步幅频率以小步幅高频率为好，个人认为。\"},{\"para\":\"- 跑后 - \"},{\"para\":\"1， 跑后一定要拉伸\"},{\"para\":\"2， 冬天尽量趁早回家洗澡，身体关节保暖至关重要。\"},{\"para\":\"3， 跑后可以加餐，番薯 玉米 粥 各种水果 都行。\"},{\"para\":\"4， 晚上早点睡，躺着睡就把膝盖或者小腿部位垫高，侧身睡就蜷着膝盖，可以喝纯牛奶。\"},{\"para\":\"最后，还是安全问题。独身跑步最好带上零钱，渴了可以买水，崩了可以坐车；手机，紧急联系；补充物品，一块士力架都是神器哇；\"},{\"para\":\"以上。\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"凭什么他不择手段什么都有，我兢兢业业却是穷光蛋？\",\"content\":[{\"para\":\"好久没有用经济学模型灌鸡汤了，今天来灌一发吧 hhhhhhhhhhhh\"},{\"para\":\"假定有 K 种彩票，都卖 1 块钱。它们分别以概率  支付给你 100 块钱。同时，购买第 k 个彩票时，你要支付  块钱的“心理成本”。这个“心理成本”并不是你实际支付的货币，它代表你选择第 k 个彩票，在货币支付之外对你幸福程度的影响。不失一般性，假定任何一个人对 K 种彩票的心理成本之和都为零。假定你只有 1 块钱，那么你购买彩票 k 的期望支付为  那么什么叫做“不择手段”呢？就是对每一种彩票的心理成本都是零。这样一来，效用最大化的选择是购买彩票 。但是一个并非“不择手段”的人，效用最大化的选择就不一定是  了。因为他选择  的心理成本  可能很大，以至于还不如选择中奖概率更低，但心理成本更小的彩票 。\"},{\"para\":\"由于 ，所以我们一定有 。因此，如果只评价一个个体的预期财富，那么“不择手段”的人的预期财富确实是所有人中最大的。但是幸福程度则不一定。由于心理成本有可能是负的（例如选择了一种高贵行为——从事低工资但能帮助急需帮助的人的职业），选择一个更小的 ，并不代表就选择了一个小于  的预期支付。\"},{\"para\":\"另外，选择兢兢业业一生也可能什么都得不到，这也是我选择“彩票”这个思维工具的另一个考虑。但“什么都得不到”是事后的。但在这个结果实现之前，他很可能已经选择了让自己预期的幸福程度最高的道路。\"},{\"para\":\"我也来灌个经济学（毒）鸡汤 @Reinhardt Jin\"},{\"para\":\"在宏观经济学当中，如果我们考虑一个家庭的效用最大化问题，而所使用的市场结构是 Sequential Market（就是说，市场每天都开放，每天都可以去市场上买卖商品；相对应的市场结构是 Arrow-Debreu Market，市场只在第一天开放，在这一天签订好所有未来交易的协议；在一定条件下两个市场是等价的）的话，需要给定一个借款约束（Borrowing Limit），这个约束至少要保证家庭所借的钱不能超过它未来所有收入折现后的总价值（这样的约束叫作 Natural Debt Limit）。\"},{\"para\":\"当然，上面也说了，这是“至少要保证”，实际上借款约束可以更加紧，比如我们也可以要求借款永远不能大于 0——也就是说，家庭只能有存款（借款为负数），永远不能有负债——这样的约束叫作 Ad hoc Debt Limit。\"},{\"para\":\"如果我们看现实生活，那么家庭往往是在这两个极端之间取一个折中的值，当然不可能一点负债都没有（房贷啊、车贷啊之类的），但是每个家庭都会潜在的设定一个约束，比如房贷最多借 200 万，车贷最多借 20 万，如此这般。\"},{\"para\":\"这样看的话，那些“矜矜业业”的老实人，这个约束的值相对都会低一些；而那些“不择手段”的人，这个约束的值相对就会高一些，甚至有些人不择手段到把这个约束无限放松——换言之就是放弃了这个借款约束。\"},{\"para\":\"话说回来，为什么要有这个借款约束呢？这个借款约束还有一个名字，叫作“Non-Ponzi Scheme”，这里的 Ponzi 就是庞氏骗局里的“庞氏”了。如果我们不设置这个借款约束，那么有一种方法可以无限提高每天的消费，从而无限提高一个家庭的效用，这个方法就是“拆东墙补西墙”，不断地借钱用来换昨天的欠债，甚至借到完全不可能还清的地步。\"},{\"para\":\"即使不放弃约束，我们也很容易证明，家庭只需把这个约束“放松”一些，允许的借款上限提高一些，就能够获得更多的消费（和总效用）。\"},{\"para\":\"所以，不择手段却活得更好，其实并不奇怪。\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"投行、券商工作强度这么高，女生该不该去？听听前辈怎么说\",\"content\":[{\"para\":\"目前度假中，先生开车，我诚恳地说一下。我坐标伦敦。纽交所做了十几年，手上投行的项目做了两年，也算是有资格回答你的问题。\"},{\"para\":\"1. 工作强度。累，不论男女都累，与性别无关。年轻时是学习的时候，读书为了明理辨是非。工作其实就是一个继续学习的过程，不过有一份金钱上的回报而已。相信我，每一滴汗水都不会白流。当你真正投入一份工作，强度很多是自己加给自己的。要出差，要加班，这是工作的一部分。我最忙的时候一天跑了德国三个城市。一次呆在瑞士二周要出报告，刚好芦笋季节，吃了整整两周。有次碰上误机，全组进度延误被老板骂死。吃不了这些苦，或者不想吃这些苦也没必要勉强自己。我们班 MBA 毕业女同学大部分都是相夫教子，也是其乐融融。\"},{\"para\":\"2. 金融行业决不比其他行业高大上。我家常用的电工，水管工时薪超过所有投行 VP。你要问问自己的选择是人云亦云，还是对这行真正有兴趣。这行范围太大，要具体到一个可能的职位，一天的工作表。在对照自己，是不是自己真的想做的。不要为了钱和前途来选择行业。一个全民金融的时代并不是一个好时代。\"},{\"para\":\"3. 婚姻和孩子。对女性重要，对男性同样重要。其实随着你做到高层，很多问题其实迎刃而解了。不是说不忙了，而是你可以自己全面安排你的时间和想做的事情。从办公地方到时间。从项目和想合作的人。生孩子和事业不矛盾，前提是你有足够的资本和不可替代性。事业瓶颈区中层女性受生育影响最大。有一个在行动上支持你的先生比什么都可贵。加上一个赏识你的大老板，基本矛盾就解决了。\"},{\"para\":\"4. 不要追求完美。无论在工作还是家庭。平安喜乐。家人健康，孩子上进就是幸福。有一定经济基础后，你的追求是会有所改变的。事业家庭双成功的女性背后付出的辛苦你是看不见的。我这周度假前三天每天白天陪孩子，半夜工作回复邮件。直到今天才开始把工作彻底放下。女性不要过多给自己压力，在自己能力范围内做到最好，就是成功。社会压力是最无价值的东西，自己的内心要学会强大。一技压身如同心有宝剑。\"},{\"para\":\"正视工作，爱护家人，祝你心想事成。\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"哎呀，一个手滑把重要文件给删了，还有机会恢复吗？\",\"content\":[{\"para\":\"创建文件：\"},{\"para\":\"盖大楼（文件本体），同时制作一个指向楼的路标（指针）。用户通过路标就能找到楼。\"},{\"para\":\"“删除”文件（移动至回收站）：\"},{\"para\":\"在路标上写一个“拆”字。\"},{\"para\":\"恢复文件（从回收站恢复）：\"},{\"para\":\"将路标上的“拆”字抹掉。\"},{\"para\":\"“完全”删除文件（这里的“完全”删除指的是 Shift+Delete 直接删除，或从回收站删除）：\"},{\"para\":\"把路标拆了，楼先留着。这样，只记路标位置的用户就无法找到这个楼的具体位置了，而且也不会消耗太多的时间（毕竟拆路标比拆楼容易多了）。\"},{\"para\":\"此时，虽然楼还在原地，但是这块地已经被系统认定为“空地”了——文件本体占据的空间被加入到硬盘可用空间中。\"},{\"para\":\"恢复文件（恢复“完全”删除的文件）：\"},{\"para\":\"因为废弃的大楼还在原地，专业的搜救队（数据恢复工具）还是有可能找到它的。然而楼附近很可能都是废墟（被删除数据），它们可能会干扰搜救队的判断，造成抢救失败。一般来说，搜救队会尝试将楼 1：1 整体复制到其他场所，这样如果抢救失败了，用户还有机会请求其他搜救队的帮助；而如果原地抢救，万一失败，可能会对楼造成无法逆转的破坏。\"},{\"para\":\"在英文维基百科上有一些搜救队的联系方式，如有需要可以参考：List of data recovery software\"},{\"para\":\"恢复文件的原理：\"},{\"para\":\"从一片废墟中找到目标大楼的“招牌”。找到之后，以找到的楼为原型，在其他地方建造一模一样的新楼。\"},{\"para\":\"（招牌：绝大多数的文件都以特定内容开头和结尾，比如 GIF 格式图片一定是以 GIF87a 或者 GIF89a 开头、十六进制数字“3B”结尾。只要定位到特定文件头、文件尾，基本就能确定这部分数据属于同一个文件，以及判断出该文件的格式）\"},{\"para\":\"再创建文件：\"},{\"para\":\"施工队到达施工现场后，发现这里已经有大楼存在，但是这个大楼已经废弃，于是把它炸了，盖新的楼。这时候原来的楼就彻底找不到了，最多只能抢救出一部分残骸。\"},{\"para\":\"（注：以上信息仅对普通硬盘有效；如果使用的是SSD 固态硬盘，且SSD硬盘本身和操作系统都支持 Trim 指令 ，则在执行“完全”删除操作的同时，会立刻开始拆楼，因此删除的数据无法找回。感谢老赵 和 superheasy 补充）\"},{\"para\":\"-\"},{\"para\":\"有知友问到如何彻底删除文件，补充一段。\"},{\"para\":\"“粉碎”文件（使用第三方工具，在普通硬盘上彻底删除文件）：\"},{\"para\":\"将原来的楼炸掉，然后在废墟上搭建违章建筑（全零、全一，或者随机无用数据）。搭建完成后，将违章建筑炸掉，再搭建新的违章建筑。如此反复一定次数后，原来的楼就连渣都找不到了。\"},{\"para\":\"该操作需要在炸楼后盖新楼（且可能会盖好几次），因此速度非常慢。\"},{\"para\":\"能够完成此工作的工程队（文件粉碎工具）有很多，请自行查找。\"},{\"para\":\"请不要在 SSD 固态硬盘上使用文件粉碎工具，因为：\"},{\"para\":\"1.SSD 硬盘的寿命与写入数据的次数有关。文件粉碎工具会多次写入数据，严重影响硬盘寿命。\"},{\"para\":\"2.由于耗损平均技术（ Wear leveling），在 SSD 硬盘上无法强行指定写入数据的位置，这一点与普通硬盘不同。也就是说，SSD 硬盘上搭建的违章建筑很可能和原来的楼位置完全不同，无法达到破坏楼的效果。\"},{\"para\":\"3.由于上文中提到的 Trim指令，一般并不需要刻意执行“粉碎文件”操作。\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"「我手上有你的性爱视频，快点打 1 万块钱」\",\"content\":[{\"para\":\"曾经办理过一起敲诈勒索的案件。\"},{\"para\":\"受害人是一个年轻的姑娘。一天，她的 QQ 上收到了一个陌生人的好友申请“我这里有点关于你的东西”，出于好奇姑娘通过了这个申请，对方二话不说就发送了一条视频。姑娘点开视频后惊讶的发现，视频里面正是她和男友的性爱录像。\"},{\"para\":\"这些私密的东西，她一直都保存在自己的电脑上，从来也没有向其他人泄露过，男友也表示绝对不是自己泄露出去的。陌生人是怎么得到的视频？\"},{\"para\":\"聪明的姑娘马上就意识到自己可能碰到了黑客的敲诈。接着，两人就开始斗智斗勇的过程，在此期间姑娘展现出了极高的法律素养。\"},{\"para\":\"姑娘主动出击：你想怎么样？\"},{\"para\":\"对方：我还没想好。\"},{\"para\":\"姑娘：没想好要多少钱？（敲诈勒索罪要求行为人以索要财物为目的）\"},{\"para\":\"对方：不为钱，图个乐子。(不以索要财物为目的，顶多构成民事侵权）\"},{\"para\":\"姑娘思考了一会故意报了个低价:我出 500 块买这个视频，你把视频删了。\"},{\"para\":\"对方感觉遭到了侮辱：500？你当我要饭的？那就不谈了，我分享到黑客群里了。（已经存在威胁的话语）\"},{\"para\":\"姑娘：那你想要多少？\"},{\"para\":\"对方：至少 1 万。（明确的报价体现对方具有勒索财物的故意）\"},{\"para\":\"姑娘：我只有 3000，我也没有什么收入来源的，这是我能力的极限。（当地的标准敲诈勒索 4000 元以上才构成犯罪）\"},{\"para\":\"经过一番讨价还价，最终双方同意以 5000 元成交。\"},{\"para\":\"姑娘：约个时间地点我把钱给你。（为确定对方身份要求当面交易）\"},{\"para\":\"对方：呵呵，你还是转账给我把，提供了一个银行账号。（被对方识破）\"},{\"para\":\"协商之后，姑娘立马保存了聊天记录，然后到银行向账户进行转账，并保留了转账凭证。带着证据，直接到公安机关去报案。\"},{\"para\":\"公安在后续的侦查过程中，发现银行卡确实不是真实姓名注册的黑卡，但通过银行 ATM 机的取款录像和视频监控分析出了嫌疑人的行动轨迹，最终抓获了嫌疑人。\"},{\"para\":\"后续案件起诉到检察院，作为承办人检察官，我看到这份聊天记录后就觉得这个案件定罪没有问题，所有法律上关于敲诈勒索罪的构成要件，都在双方的讨价还价中体现的淋漓尽致，所以很快就做出了构罪起诉的决定移送到了法院，最终嫌疑人也是得到了应有的刑罚。\"},{\"para\":\"在遇到敲诈勒索时，作为被害方有几个关键点十分重要；\"},{\"para\":\"1.敲诈勒索行为往往以口头行为发生，想法设法让对方通过文字形式沟通，并保存相关的沟通记录。这是定罪的最有力证据。\"},{\"para\":\"2.敲诈勒索要求达到一定的犯罪金额，在讨价还价过程中适当的在构罪金额以上达成协商，才能作为刑事犯罪由公安机关进行侦查。\"},{\"para\":\"3.金钱交付的过程要留痕，证明对方已经取得财物。\"},{\"para\":\"4.报案要及时，相信警察叔叔的专业水平。\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"特别想跟老板说一句：欠我的加班费，你打算什么时候给？\",\"content\":[{\"para\":\"文章来自机构帐号：洪文律所\"},{\"para\":\"常在职场走，难免会加班。对于我们职场人来说，加班是十分常见的事情，而关乎我们切身利益的加班费就成了大家最为关注的问题。从劳动者的角度看，加班费是对其付出过量劳动的一种补偿；从用人单位角度来说，支付加班费能够有效地抑制用人单位随意地延长工作时间，从而达到保护劳动者的目的。那么对劳动者和用人单位双方都如此重要的加班费，到底该如何计算呢？\"},{\"para\":\"洪文君教你如何用三步轻松计算加班费：\"},{\"para\":\"第一步：确定加班事实\"},{\"para\":\"计算加班工资的一个前提就是“加班事实”。\"},{\"para\":\"“用人单位根据实际需要安排员工在法定标准工作时间以外工作”，即由单位安排的加班，用人单位才支付加班费用。\"},{\"para\":\"1、自愿工作的不属于加班。如果工作不是单位的要求、决定，也没有单位认可的加班记录，只是员工自愿加班，则不属于“加班事实”，无须支付加班费。但如果单位对员工的加班予以追认，则视为单位安排的加班，就应该支付。\"},{\"para\":\"2、有证据证明加班为单位安排，可确认为“事实加\"},{\"para\":\"班”。变相延长员工的工作时间，属于加班。前提是员工须有证据证明，确属因单位安排了过多任务，不得不在正常的工作时间以外加班。\"},{\"para\":\"因此，员工自愿加班的话单位是不需要支付加班费的。劳动者如果认为自己的工作需要加班，可以要求单位来进行安排。这样才可以依法得到加班工资，才可以保护自己的合法权益。\"},{\"para\":\"第二步：加班费的计算基数 要准确计算加班费，首先必须正确确定加班费的计算基数，实践操作中具体要把握以下几点：\"},{\"para\":\"1、如果劳动合同有明确约定工资数额的，应当以劳动合同约定的工资作为加班费计算基准。应当注意的是，如果劳动合同的工资项目分为“基本工资”、“岗位工资”、“职务工资”等，应当以各项工资的总和作为基数计发加班费，不能以“基本工资”、“岗位工资”或“职务工资”单独一项作为计算基数。\"},{\"para\":\"2、如果劳动合同没有明确约定工资数额，或者合同约定不明确时，应当以实际工资作为计算基数。\"},{\"para\":\"凡是用人单位直接支付给职工的工资、奖金、津贴、补贴等都属于实际工资，具体包括国家统计局《关于工资总额组成的规定若干具体范围的解释》 中规定“工资总额”的几个组成部分。但是应当注意一点，在以实际工资都可作为加班费计算基数时，加班费、伙食补助和劳动保护补贴等应当扣除，不能列入计算范围。\"},{\"para\":\"3、在确定职工日平均工资和小时平均工资时，应当按照劳动和社会保障部《关于职工全年月平均工作时间和工资折算问题的通知》规定 ，以每月计薪时间为 21.75 天和 174 小时进行折算。\"},{\"para\":\"4、实行计件工资的，应当以法定时间内的计件单价为加班费的计算基数。\"},{\"para\":\"5、加班费的计算基数低于当地当年的最低工资标准的，应当以日、时最低工资标准为基数。\"},{\"para\":\"第三步：加班费的计算 加班也分为不同的情况，因此，在确定了加班费的计算基数后，还必须依照法规对现实情况进行区分，才能准确计算出加班费：\"},{\"para\":\"1、标准工时制度的加班费计算\"},{\"para\":\"依据《中华人民共和国劳动合同法》第四十四条 有下列情形之一的，用人单位应当按照下列标准支付高于劳动者正常工作时间工资的工资报酬：\"},{\"para\":\"（1）在日法定标准工作时间以外延长工作时间的，按照不低于劳动合同规定的劳动者本人小时工资标准的 150% 支付劳动者工资；\"},{\"para\":\"（2）在休息日工作，而又不能安排补休的，按照不低于劳动合同规定的劳动者本人日或小时工资标准的 200% 支付劳动者工资；\"},{\"para\":\"（3）在法定休假日工作的，按照不低于劳动合同的劳动者本人日或小时工资标准的 300% 支付劳动者工资。\"},{\"para\":\"注意：三八妇女节和五四青年节不属于法定节假日，如果不放假，用人单位也不需要支付加班费。\"},{\"para\":\"2、综合计算工时制度的加班费计算\"},{\"para\":\"按照劳动部《关于企业实行不定时工作制和综合计算工时工作制的审批办法》和《关于职工工作时间有关问题的复函》规定，经批准实行综合计算工时工作制的企业，在综合计算周期内的总实际工作时间不应超过总法定标准工作时间，超过部分应视为延长工作时间并《劳动法》第 44 第 1 款的规定支付工资报酬，其中法定休假日安排劳动者工作的，按《劳动法》第 44 第 3 款的规定支付工资报酬。而且，延长工作时间的小时数平均每月不得超过 36 小时。\"},{\"para\":\"3、不定时工时制度的加班费的计算\"},{\"para\":\"一般情况下，经批准实行不定时工作制的企业不需要支付加班费。\"},{\"para\":\"4、实行计件工资制度的加班费计算\"},{\"para\":\"实行计件工资的劳动者，在完成计件定额任务后，由用人单位安排延长工作时间的，应根据上述规定的原则，分别按照不低于其本人法定工作时间计件单价的 150%、200%、300% 支付其工资。\"},{\"para\":\"有关加班工资的计算方法，洪文君已经为您全面的讲解完毕，希望能对您的工作有所帮助。\"},{\"para\":\"「知乎机构帐号」是机构用户专用的知乎帐号，与知乎社区内原有的个人帐号独立并行，其使用者为有正规资质的组织机构，包括但不限于科研院所、公益组织、政府机关、媒体、企业等。这不仅是知乎对机构的「身份认证」，更是涵盖了内容流通机制、帐号规范等全套帐号体系。和个人帐号一样，机构帐号开通不需要任何费用，同时也受社区规范的监督管理，并要遵守相关协议。目前机构帐号入驻采用邀请制。您可以通过  什么是「知乎机构帐号」 来了解更多机构帐号信息。\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"这种石头怎么长得这么污……\",\"content\":[{\"para\":\"生活中有很多不经意的细节，都会摇身一变成为大地上的景致，区别无非是体量而已，相似的则是内在物理化学机制。比如雨后流过土地的水流会蜿蜒出辫状河的形态，又如从草坪围石缝隙里被雨水冲出的泥土会在水泥路面上堆成微小的扇状。在这里，则是蘑菇石的原理从微观沙堆投射了出去。\"},{\"para\":\"1.什么是蘑菇石？\"},{\"para\":\"\"},{\"para\":\"（美国 Kansas 的 Mushroom 州立公园）\"},{\"para\":\"\"},{\"para\":\"（美国亚利桑那州常见的蘑菇石）\"},{\"para\":\"蘑菇石，对应英文是 mushroom rock/tent rock/hoodoos。它是对一种地质现象的形象描述：下部为细长石柱，顶部是一个宽大的大石块 / 巨岩，石块直径明显或者略大于石柱，像一朵香菇一样戳在地上。二者往往存在肉眼可见的质地不同，但彼此间又紧密相连，仿佛从天地诞生时就连在了一起。\"},{\"para\":\"当石柱直径与顶部石块直径差别不是特别大的时候，就会变成另一个回答里面土耳其卡帕多西亚的情形，看起来污污的样子：\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"（土耳其，Cappadocia 的蘑菇石，或称 hoodoos / fairy chimney）\"},{\"para\":\"2.它的原理是什么？\"},{\"para\":\"蘑菇石的原理如果用最简单的语言概括，那就是“差异风化”。\"},{\"para\":\"岩石上部和下部由于质地不同，抵抗风化的能力也截然不同。当下部岩石疏松不耐风化而上部岩石致密耐风化时，且如果同时存在某种外界因素（如节理、裂隙、流水侵蚀等）让地层分解成岩柱的情况下，就会由于上部耐风化岩石抵御外界侵蚀，保护了正下方的不耐风化地层，形成上粗下细的蘑菇状岩柱。由于雨水会沿着顶部大块岩石汇聚到底部，所以往往还会出现顶部岩石与下部岩柱衔接的部位最细的情况——雨水都从那流，自然会冲得比较细。\"},{\"para\":\"\"},{\"para\":\"（1）上下地层岩石类型不同，导致抗风化能力差异。\"},{\"para\":\"以卡帕多西亚为例，这些蘑菇石上下部岩石的质地，即便是非专业人士都可以看出有显著不同：上部岩石发灰，几乎看不出分层；下部岩石偏白，可见明显层次。下部偏白的岩石是火山凝灰岩，这是一种疏松多孔密度低的岩石，是古代火山喷发活动后期堆积起来的火山灰；顶部则是另一次火山活动喷出的熔岩冷却后形成的喷出岩（该处常见玄武岩），或火山爆发产生的碎石堆积而成的粗粒火山碎屑岩，坚硬致密，耐得住风雨侵蚀。\"},{\"para\":\"它不仅是一种奇妙的景观，更是记载着古代多次火山喷发活动的密码书。如果你懂得这些密码，就能看出更多有意思的东西。\"},{\"para\":\"\"},{\"para\":\"（Cappadocia 蘑菇石上部“蘑菇朵”体现出喷出岩的典型特征：气孔充填而成的杏仁体构造）\"},{\"para\":\"\"},{\"para\":\"（Cappadocia 蘑菇石体现的地层旋回性）\"},{\"para\":\"------------------\"},{\"para\":\"（2）上下岩石性质原本相同，但因某种化学作用形成抗风化团块 / 结核\"},{\"para\":\"以美国堪萨斯的 mushroom rock 州立公园为例，这里在白垩纪时期曾经是古代河口—海岸地带。海浪和河流的共同作用造就出以砂泥岩为主的 Dakota 组地层。这些蘑菇石就产自 Dakota 组下部质地纯粹的河流相砂岩地层里。\"},{\"para\":\"\"},{\"para\":\"（原始大图）\"},{\"para\":\"\"},{\"para\":\"（地质视角看待的大图）\"},{\"para\":\"当地地调部门的地质学家发现，该公园的蘑菇石并没有上下岩石类型的明显不同。无论是相似的单层厚度、一致的层理类型、几乎没有变化的粒度特征，都在彰显蘑菇头与蘑菇杆具有一样的 DNA。直到人们发现更多的蘑菇石后，才明白它的成因：陆相砂岩中常见的结核。\"},{\"para\":\"\"},{\"para\":\"（右图一团一团产出的“蘑菇石”，正是典型的结核形态）\"},{\"para\":\"地层水中的矿物质聚集在一起，在砂岩孔隙中沉淀析出，将砂岩颗粒牢牢粘合在一起便成为了结核。它使得地层中的局部变得相对更加致密，从而更能抵御风雨的侵蚀，构成了发育差异风化地貌的第一要素。\"},{\"para\":\"---------------\"},{\"para\":\"（3）未固结地层中存在较抗风化的异常大颗粒，形成差异风化。\"},{\"para\":\"这是与本问题情形最相似的一种“蘑菇状”构造。\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"（意大利 Ritten 的 earth pyramid 构造，太魔性了）\"},{\"para\":\"瘦高的小土堆上面顶个石头，与题主的照片几乎如出一辙，不同的只是把沙子换成了土堆。这也同样是一个典型的抗风化地层（石块）保护正下方的不耐风化地层（土堆）的例子。\"},{\"para\":\"它的形成需要一些条件。\"},{\"para\":\"首先是混杂堆积的沉积物，大石块与细颗粒的泥砂要混合在一起。人工堆积的当然不提了，自然条件下出现这样的情形需要一些特殊的沉积环境，比如泥石流，比如山洪，比如冰川堆积物——意大利的这个构造，便发育在古代冰川堆积的冰碛物里。\"},{\"para\":\"其次是半固结的成岩阶段，泥砂刚好有点变硬，但远称不上坚固。颗粒与颗粒之间存在少量的胶结（早期钙质胶结或者粘土胶结），但尚禁不住风化的摧残。\"},{\"para\":\"当满足这两个条件，且刚好暴露在多雨水地区的地表时，剩下的工作交给天气和重力就 OK 了。\"},{\"para\":\"3.总结\"},{\"para\":\"差异风化是自然界中许多有趣地貌的成因。由于岩石的抗风化性千差万别，所以在一些岩性复杂多变的地区，差异风化就会形成许多好玩的地貌。合理认识这种差异性产生的本质，对于解读地貌背后的故事大有裨益。\"},{\"para\":\"至少，下次带朋友出去浪的时候，装逼的成功率会变高。\"},{\"para\":\"\"},{\"para\":\"（Hoodoos，糊涂石）\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"大误 · 宇宙级斑羚飞渡\",\"content\":[{\"para\":\"自己改写了一个段子。\"},{\"para\":\"如果斑羚真有那么高的智商和组织性，下面这种情况更可能发生：\"},{\"para\":\"七八十只宇宙斑羚被太空猎人逼到卡冈图亚附近，卡冈图亚是电影《星际穿越》中提到的一个巨型克尔黑洞。\"},{\"para\":\"其实太空狩猎队的飞船十分先进，能达到 0.6 倍光速，而宇宙斑羚虽有腿肌发达的四条长腿，善于奔跑，但健壮的公斑羚最多只能跑出 0.5 倍光速的成绩，母斑羚、小斑羚和老斑羚只能跑到 0.4 倍光速，而能一举加速到 0.6 倍光速以上从狩猎队包围中逃逸的超级宇宙斑羚还没有生出来呢。\"},{\"para\":\"开始，斑羚们发现自己陷入了进退维谷的绝境，一片惊慌，有一只老斑羚不知是老眼昏花还是故意要逞能，竟全力加速冲向黑洞，像颗流星似的笔直坠落下去，好一会儿，红移面上还能隐约看到它的影像。\"},{\"para\":\"过了一会儿，斑羚群渐渐安静下来，所有的眼光集中在一只身材特别高大、毛色深棕油光水滑的公斑羚身上。这只头羊神态庄重地悲哀地咩了数声。整个斑羚群迅速分成两拨，老年斑羚为一拨，年轻班羚为一拨，两拨斑羚的数量大致均衡。\"},{\"para\":\"就在这时，我看见，从那拨老斑羚里走出一只公斑羚来。公斑羚朝那拔年轻斑羚示意性地咩了一声，一只半大的斑羚应声走了出来。突然，半大的斑羚朝前飞奔起来，差不多同时，老斑羚也快速助跑，半大的斑羚跑到无限红移面附近，纵身一跃，跳了进去；老斑羚紧跟在半大斑羚后面，头一勾，也跃出去；这一老一少进入的时间稍分先后，速度也略有差异。我吃了一惊，怎么，自杀也要老少结成对子，一对一对去死吗？\"},{\"para\":\"突然，一个只有广义相对论课上学到的景象在我脑海里出现了：老斑羚凭着娴熟的技巧，与半大斑羚在卡冈图亚无限红移面与外视界之间的能层中对接，当它的身体出现在半大斑羚蹄下时，两只斑羚组成的系统刚好处在能层中负能轨道附近。半大斑羚的四只蹄子在老斑羚宽阔结实的背上猛蹬了一下，就像踏在一块跳板上，身体获得了黑洞的转动能奇迹般的再度加速。而老斑羚就像燃料已输送完了的火箭残壳，自动脱离宇宙飞船，不，比火箭残壳更悲惨，在半大斑羚的猛力踢蹬下，像只突然断翅的鸟笔直坠落入负能轨道。瞬间，只见半大斑羚以不可思议的，目测肯定远超过 0.6 倍光速的速度猛冲出无限红移面，兴奋地咩叫一声，冲进星辰大海不见了。\"},{\"para\":\"利用黑洞角动量加速成功，紧接着，一对对斑羚凌空跃起，在黑洞上空画出一道道令人眼花缭乱的弧线，每一只年轻斑羚的成功飞渡，都意味着有一只老年斑羚掉入黑洞万劫不复。\"},{\"para\":\"我没想到，在面临种群灭绝的关键时刻，宇宙斑羚群竟然能想出利用克尔黑洞的彭罗斯过程，牺牲一半挽救另一半的办法来赢得种群的生存机会。\"},{\"para\":\"我没想到，老斑羚们会那么从容地走向死亡。\"},{\"para\":\"PS：角动量不为 0，换句话说就是旋转的黑洞称作 Kerr 黑洞，克尔黑洞外视界与外无限红移面之间有能层，能层中有负能量轨道。若一个物体进入能层后，分裂为两部分，一部分进入负能轨道，另一部分在正能轨道，这时正能轨道的一部分会获得能量，冲出无限红移面。这一过程中获得的能量来自黑洞自转的转动能量，这种能量的提取机制被称为 Penrose 过程。\"},{\"para\":\"详见：黑洞是否旋转？又是否无尽旋转？和我们能从黑洞中获得能量吗\"},{\"para\":\"电影《星际穿越》中男主角的小飞船选择掉入黑洞就是为了使主飞船获得能量离开卡冈图亚。\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"你不请自来做个 PPT 胡乱分析一通就要钱，做咨询的吧？\",\"content\":[{\"para\":\"说明：\"},{\"para\":\"1. 本文为之前三篇文章总和在一起的完整版，内容与之前相同，看过的就不用再看了\"},{\"para\":\"2. 本文较长，阅读完大约需要10 分钟\"},{\"para\":\"3. 本文保留版权，如有转载请标明出处及作者，转载请勿改编\"},{\"para\":\"在前段时间写“我的前半生”系列文章的时候，就讲过要把这个数羊的故事给怼回来。先说清楚，我在这里所讨论的咨询公司是以 MBB 为代表的顶级战略管理咨询公司，不讨论在飞机杂志上经常看到的“深耕十数年，只做一件事”那些。\"},{\"para\":\"数羊的故事\"},{\"para\":\"有一个牧羊人，正在草地上放羊，忽然走来一个西装革履的年轻人。年经人走到牧羊人面前说：“老先生，我可以为您服务，我将告诉您的这群羊有几头，作为酬劳您需要给我一头羊”。 牧羊人还未作答，年青人就开始了工作，年轻人用笔记本电脑无线上网，链接上 NASA 的内部网，调动低轨道卫星，把卫星遥感成像的图片再通过软件分析，十几分钟后，年轻人再次走到牧羊人面前：“老先生，您的羊群共有 763 头。”说完后他抱起一只羊就要走。\"},{\"para\":\"牧羊人这时叫住了年轻人，说：“年轻人，如果我能猜出你就职的公司，你可不可以把酬劳还给我”？\"},{\"para\":\"“可以”，年轻人答。\"},{\"para\":\"“你是麦肯锡公司的”，牧羊人说。 年轻人很惊讶，“您怎么知道？”\"},{\"para\":\"牧羊人笑了：“有三个理由足以让我知道：第一，我没有请你，你自己就找上门来；第二，你告诉了我一个我早已知道的东西，还要向我收费；第三，一看就知道你不懂我们这一行，你抱的根本不是羊，而是一只牧羊犬。”\"},{\"para\":\"玩笑开大了\"},{\"para\":\"提到管理咨询，必然提到麦肯锡，而提到麦肯锡，基本都会捎带手的说说这个数羊的故事。圈内人当自嘲，一笑了之，不明真相的群众们可能自此对管理咨询的第一印象就是：这是一帮什么也不懂，就靠忽悠骗钱的孙子。而最近热播的《我的前半生》夸张的展示管理咨询肤浅的表层，再加上一些基于想象的渲染，更是给管理咨询这只小白羊披上了一层狼皮。尽管一部分观众的焦点集中在“八万块的鞋”，还是有相当多的人开始对管理咨询到底是什么产生兴趣，而当他们搜索相关内容时，麦肯锡数羊的故事一定是不可错过的居家旅行必备良药啊。\"},{\"para\":\"而且这个故事流传已久，我搜了中文和英文的版本，据不完全统计，羊的数量从 137 只到 3728 只不等；年轻人的交通工具从走路到跑车不等；工具从 PDA（看出来了么？这可是至少 15 年前的东西了）到笔记本电脑不等；交付形式从口头告知到 130 页彩印报告不等……\"},{\"para\":\"玩笑开大了。\"},{\"para\":\"第一怼：顾问与客户，谁找谁呢？\"},{\"para\":\"麦肯锡的马文·鲍尔（Marvin Bower），管理咨询业的教父级人物，在 1951 年说道“我们的政策是不招揽客户或者为自己的服务打广告，这不是出于道德原因，而是因为那样与我们的专业方式不符。如果我们为自己的服务打广告或者招揽客户，就必然要暗暗许诺我们能够为客户做到什么。但是在一开始的时候我们根本就不知道自己究竟能做到什么，所以这种许诺是不符合我们最高的专业标准的。”（引自《麦肯锡传奇》）\"},{\"para\":\"管理咨询是一种专业服务，它的服务对象是企业高层管理者，它的作用客体可以是客户的战略、愿景、机制、组织、流程、方法、能力等等。咨询服务又是一种定制化的服务，针对客户需要解决的问题提供解决方案，这个方案会考虑到客户的经营期望 / 目标、现状、行业、环境、趋势、风险、投入等因素，所以即便是类似行业的类似问题，对不同的客户也一定是定制的解决方案。而越是定制化的专业服务，就越没法“不请自来”的去开发客户 --- 因为你根本不知道客户要的是什么，也就根本不知道该对客户说什么。\"},{\"para\":\"我们都接到过街头传单，有就餐给打折的、售楼卖商铺的、卖健身年卡的，不一而足；也经常接到陌生电话，问要不要贷款的、要不要发票的、要不要学英语的…… 各位，你们谁接到过传单或者电话，说“听说你们快倒闭了，要不我来给你们做个管理咨询吧”，或者“看起来你摊上大事了，要不我来帮你打个官司吧”？估计大家都没碰到过，因为这么做的人不是已经倒闭了，就是已经被人打死了。真碰到这种随机兜售“定制化专业服务”的，那一定是骗子：这位施主，看你眉清目秀骨骼精奇，来日必定大有所为，不如老衲送你几句……\"},{\"para\":\"既然定制化的专业服务没法直接敲门进去兜售项目，咨询公司是靠什么来吸引客户找上自己的呢？是专业和口碑。最负盛名的管理咨询公司，麦肯锡，是芝加哥大学教授詹姆斯·麦肯锡（James McKinsey）在 1926 年创立的，第一批客户是老麦同志的熟人，最早期的咨询顾问利用自己在会计、管理和工业方面的专业知识帮助客户的 CEO 解决问题，并在一系列的成功项目基础上逐渐建立起口碑。其他的管理咨询公司大都以类似的方式慢慢开始开展自己的业务。\"},{\"para\":\"现如今，顶级管理咨询公司的项目大体有这么几个来源：\"},{\"para\":\"- 存在已久的老客户，这其实是最稳定可靠，且占比最大的业务来源\"},{\"para\":\"- 与咨询公司合作过的企业高管，在跳槽去另外一家公司之后，找回熟悉的咨询公司开展合作\"},{\"para\":\"- 从咨询公司离职的顾问，在加入企业之后找老东家寻求咨询\"},{\"para\":\"- 慕名而来的企业寻求帮助\"},{\"para\":\"同时，每家顶级咨询公司都会积极开展市场和行业调研，频繁发布行业洞见、分析报告、评论文章等；举办或参与高端经济、区域、行业论坛去发表观点。通过这些活动向市场体现专业性，提升公司声誉，然后客户自己就来了。\"},{\"para\":\"第二怼：管理咨询就是告诉客户他已经知道的事？\"},{\"para\":\"在这个故事里面，备受鄙视的一点就是这个年轻咨询顾问用不必要的技术和复杂方法来解决一个非常简单的问题，然后告诉牧羊人一个人家早就知道的结论，还要收费。这事儿当笑话看挺有意思，可如果较起真来会更有意思。企业不会花钱找顾问解决这么简单的问题，那么问题复杂一些的话会怎么样：如果这群羊不是几百几千只，而是一万十万只的量级呢？如果这不是一个牧羊人而是一个牧羊集团，下面有几百个牧羊人，每人负责一大群羊，怎么数呢？如果这牧羊人转行了，办个养鸡场去养鸡了，一年几亿只，怎么办？\"},{\"para\":\"我们来做个简单的计算。还是数羊，还是一群羊，只是羊群的大小不同。假设咨询顾问和牧羊人都不改变各自数羊的方式；假设咨询顾问打开电脑连接卫星拍照识别数量的时间是 20 分钟（各版本从几分钟到十几分钟到几十分钟都有），且假设电脑计数在 1-10 万量级的计算时间无差别（以电脑的计算速度，有差别也非常有限）；假设牧羊人用传统方式数羊，每秒数 2 只，且假设即便羊可能会移动，牧羊人也不会有任何遗漏和重复计数，并始终维持同样的计数速度。\"},{\"para\":\"在前面提到对这个故事的不完全统计中，中英文版本有 6 个不同的羊的数量，我在此基础上增加一个 10 万级的情景，那么在不同情况下两种方法数羊所花费的时间对比就如下图所示\"},{\"para\":\"\"},{\"para\":\"看出区别了吧，当羊的数量比较少的时候，牧羊人效率更高，但“数羊”这个问题随着羊的数量增加而变得更复杂时，咨询顾问依然可以用同样的方法解决，而牧羊人则很快就力不从心，要么他需要用更长的时间才能数清楚，要么他需要更多的人跟他一起数才行。\"},{\"para\":\"我们再多想一点，实际上按照上面的假设，当羊的数量达到“万”级别之后，就不是牧羊人靠一只一只数的方法能解决的问题了。当羊多起来的时候会有两个难点，一个是羊是动物，就是会动的物体，当计数对象是会到处乱跑的物体时，不重复和不遗漏的计数是很难的一件事；另一个难点是人是会累的，不可能数小时不间断的进行计数。再来看看咨询顾问的方法，他用卫星照相把动态的羊群变成静止的状态，解决了第一个难点，又用计算机识别来计数的方式解决了第二个难点。这个顾问后面可能需要去完善的是怎么拍清晰度更高的照片，和怎么提高电脑识别计数的准确率，但那已经是好或者更好的问题，而不是能或不能的问题了。企业的问题也一样，很多在企业规模较小的时候靠人管理能解决的问题，在规模扩大之后就跟不上了，要么到处救火疲于奔命，要么漏洞百出发生问题，这个时候一定需要建立系统流程和管理机制，把管理者和领导者从日常事务中释放出来去专注在更有价值的决策上。\"},{\"para\":\"那为什么这个笑话会让人觉得好笑呢？为什么这样的场景让人引起某种共鸣，觉得咨询顾问给的方案不接地气呢？我自己觉得这是因为大多数人在看咨询顾问给的建议时，是站在当前甚至过去的问题立场上来评价的，但实际上CEO 请咨询顾问来是想找一个能不仅解决现在，还能解决未来问题的建议。所以当站在牧羊人角度看眼前这几百只羊的问题，会觉得什么卫星拍照电脑计数完全没必要，装逼不接地气，居然还敢收钱。但如果站在面向未来，可能有几千几万十几万羊要养的愿景角度来看这个问题，有了这种数羊的方法，CEO 八成会觉得咨询费给的值吧。当初人们刚发明计算机的时候，用数吨重几个房间那么大的机器去计算加减乘除，是不是也曾有人当笑话看呢？\"},{\"para\":\"那么多领先企业的 CxO 愿意花钱常年使用咨询公司，不是没有道理的。很多CEO 认为请咨询顾问最大的价值不是他们给的项目结果，而是分析问题的思路和解决问题的方法，咨询公司在有限的项目时间内给出的结果可能并不准确，存在很多假设和估计，但只要这个方法是对的，CEO 们和他们的有多年经验的下属们会找到更加准确的结果的。\"},{\"para\":\"在这里还想再延伸一下，这个“结果不重要，重要的是思路和逻辑”是不是听起来有点耳熟？很多咨询公司在介绍如何面试的时候经常这么说，对吧？想通了前面说的道理，就可以理解为什么有的咨询公司在面试的时候会问“请估计一下纽约有多少井盖”和“一架波音 747 飞机能装多少乒乓球”这种问题了，看似无厘头，但他们要的不是多么准确的数字结果，而是申请者是不是能想出一个好的方法来估算。你要是说这问题简单，找个人出去走一下数数看，或者拿乒乓球来装一下就知道了，那一定是会被杀无赦了。\"},{\"para\":\"回到数羊的故事，牧羊人说你告诉我的是我已经知道的事。这也是通常对管理咨询一个比较有代表性的观点，就是这群人来了做一通访谈，把我们说的总结一下，用精美的 PPT 展示出来，其实这些东西都是我们已经知道的。牧羊人的观点我认同，因为他一个人管着几百只羊，确实他是知道有多少只的。但后面的观点我就万万不能认同了，因为在一个组织里，其实很少有某个东西是“已经知道”的。越是大的组织就分工越细，否则没法管理，但这样随之而来的问题就是每个人都只能看见一部分组织，看不到全局。再加上各职能各业务单元有其自己的绩效指标，对同一个问题的观点可能就会产生分歧甚至截然相反。事实上组织内上上下下各个职能都会某件事观点一致或者有同样的理解，是绝少存在的。别说复杂组织了，就是一群几千只羊的羊群，让 10 个人分别去数一遍，出来的结果可能都不一样，而且每个人还都会觉得自己“已经知道”了。\"},{\"para\":\"那么咨询顾问的作用是什么？如果咨询顾问仅仅只是拿出一个观点，那其实等于第 11 个人去数一遍羊，非但于事无补还有可能雪上加霜。咨询顾问必须充分了解不同的人 / 职能的想法、看问题的角度、分析问题的思路和解决问题的方法，加上自己的分析判断，并结合从其他客户 / 行业得来的类似问题的“最佳实践”，给出一个公允的建议。并且比这个建议更重要的是，要给出一个科学的分析思路，和可复制的解决方法。\"},{\"para\":\"第三怼：咨询顾问都是外行？\"},{\"para\":\"这数羊的故事结尾，是牧羊人对咨询顾问说，“一看就知道你不懂我们这一行，你抱的根本不是羊，而是一只牧羊犬。”英文版本更直接，“You know nothing about my business. Now give me back my fucking dog!”。这反映了客户，主要是中基层人员，对咨询顾问是否靠谱的顾虑：你们这么年轻，又没有行业经验，凭什么告诉我们这些已经在业内几十年的人哪里做错了，应该怎么做呢？\"},{\"para\":\"这是挺经常碰到的场景，在国内尤其多，因为国内相当一部分客户还不太清楚怎么用好咨询公司。管理咨询顾问解决的是管理层面的问题，不是技术层面的问题，跟行业经验有关联但不是决定性的。管理咨询会帮助决策层把一个问题分析得更清楚，知道有什么可能的解决方法，最终的决策一定是管理者自己做。对于企业 CEO 而言，咨询公司做的基于事实的分析（以及分析的思路、方法、工具）才是最有价值的，提出的建议参考一下就行了，而决策一定要自己拿主意。不过我见到不少 CEO 是反着来的……\"},{\"para\":\"碰到这种质疑我一般会回答以下三条：\"},{\"para\":\"第一，我们没经验就对了。我们解决问题不靠经验，而是结构化的分析方法和系统化的解决方案。经验绝不是解决问题的唯一方法。咱们现在要解决的问题如果是靠行业经验和资历能解决的，那早就被你们这群行业资深人士解决了，也不用花钱请顾问。恰恰因为这个问题不是靠经验和行业知识能解决的，才会需要外部顾问的协助，找一些新的思路，看看别的企业别的行业别的国家在类似问题上是怎么解决的；或者需要抛开所有经验的束缚，回归问题本身，从纯粹的逻辑上来分析可能的解决方案。\"},{\"para\":\"第二，项目团队是一个团队。团队里面当然会有年轻一点的也有资深一点的，大家分工不同。我们当然不会让刚毕业的年轻同事随便就向管理层提建议，但也绝不会让资深顾问花时间去做数据收集和基础分析工作。对客户的建议不是某个人提出的，也不完全是项目团队提出的，而是咨询公司提出的，这里面包含着在背后支持的全球以往的项目经验、行业 / 职能专家的观点、庞大数据库的对标分析等等。\"},{\"para\":\"第三，请管理咨询不是服务外包。要想解决问题，一定是顾问与客户团队一起工作，把新的或者更科学的方法跟已有的行业经验和知识结合起来，才能找到最合适的解决方案。不因为客户高层给我钱让我出主意，这个问题就变成我的问题，然后你们就可以在旁边看戏了。这个问题始终是你们的问题，因为你们自己解决不了，所以请我们来帮忙一起解决，我是来帮你解决你的问题的。说的坦白一点，从老板的角度看，你解决不了，我花几百万请麦肯锡来帮你解决，要是最牛逼的咨询公司帮忙，你都还解决不了，那八成会先把你解决了……\"},{\"para\":\"当然了，可能确实有咨询公司是找一群年轻人搜信息，然后做一圈专家访谈，然后就提出解决方案的，这种情况下人家质疑的有道理。咨询公司一定要事先评估客户的问题是不是自己能提出有价值的可行的解决方案的，如果不是就别接这活儿，接了也是砸招牌。这对咨询顾问个人也是一样，做不了的项目别上，真的是谁行谁上。反正我是砸过招牌，后来碰上解决不了的或者价值不大的，就劝客户别找我们干这事，不值当，有这钱不如咱们做个别的项目……\"},{\"para\":\"最后总结一下\"},{\"para\":\"管理咨询是一种专业定制化服务，其服务对象是企业最高层管理者，“不请自来”的推销方式既无法体现专业性，也无从实现定制化。真正可以带来、维持和扩展业务的，是专业洞见和声誉口碑。\"},{\"para\":\"咨询顾问看问题的角度不局限于当下眼前这摊事，而是这个问题本身可以怎样被系统化的解决，往往比结论更有价值的是得出结论的分析思路和解决方法。\"},{\"para\":\"管理咨询解决的是管理层面的问题，而且往往是客户靠行业经验无法解决的问题。顾问团队各有分工，不需要每个人都很资深才能解决问题，顾问和客户的行业专家一起才能找出最佳解决方案。\"},{\"para\":\"怼完收工！\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"「哈哈，发现一个假货，商家你就等着给我赔偿吧」\",\"content\":[{\"para\":\"在之前的文章中(当葡萄酒商摊上职业打假：真的要以一赔十吗？)，我跟大家说，曾经一打一个准的职业打假团队，他们现在“知假买假”的行为很难得到法院的支持。很多知友评论：曾经法院支持“知假买假”的出发点是什么？现在为什么不支持打假了？法院这样做合理吗？除了我在上篇文章提到的 2015 年《食品安全法》修订之外，其实还有政策考量因素。\"},{\"para\":\"最高院曾在 2013 年发文，表明其为什么支持食品药品领域知假买假的行为。\"},{\"para\":\"因此，在最高院这一意见发布之后的很长一段时间内，各级法院都参照该文件，支持食品药品领域的知假买假行为。于是，才逐渐出现专业的打假团队、甚至打假集团。\"},{\"para\":\"但近两年，为什么政策风向变了？为什么法院不支持职业打假了？\"},{\"para\":\"对此，最高院又出意见了。最高院在今年 5 月 19 日给国家工商行政管理总局的一个答复中提到：\"},{\"para\":\"那么法院基于哪几点考虑不再支持职业打假了呢？如下为法院的原文答复：\"},{\"para\":\"1．按照《消费者权益保护法》第五十五条的规定，在普通消费产品领域，消费者获得惩罚性赔偿的前提是经营者的欺诈行为。民法上的欺诈，按照《民法通则意见》第六十八条的解释，应为经营者故意告知虚假情况或故意隐瞒真实情况，使消费者作出了错误意思表示。而对于知假买假人而言，不存在其主观上受到欺诈的情形。\"},{\"para\":\"2．从打击的效果来看，由于成本较小，取证相对容易，牟利性打假的对象主要是大型超市和企业，主要集中在产品标识、说明等方面。该类企业往往是同类市场上产品质量相对有保障，管理较为规范的生产经营主体，而对于真正对市场危害较大的假冒伪劣产品及不规范的小规模经营主体打击效果不明显。\"},{\"para\":\"3．从目前消费维权司法实践中，知假买假行为有形成商业化的趋势，出现了越来越多的职业打假人、打假公司（集团），其动机并非为了净化市场，而是利用惩罚性赔偿为自身牟利或借机对商家进行敲诈勒索。更有甚者针对某产品已经胜诉并获得赔偿，又购买该产品以图再次获利。上述行为严重违背诚信原则，无视司法权威，浪费司法资源，我们不支持这种以恶惩恶，饮鸩止渴的治理模式。（非常同意，知假买假是一种商业化的行为，严重浪费司法资源。）\"},{\"para\":\"基于上述原因，考虑食药安全问题的特殊性及现有司法解释和司法实践的具体情况，最高院认为目前可以考虑在除购买食品、药品之外的情形，逐步限制职业打假人的牟利性打假行为。并且最高院将根据实际情况，积极考虑人大代表提出的建议，适时借助司法解释、指导性案例等形式，逐步遏制职业打假人的牟利性打假行为。\"},{\"para\":\"合规小律师不定时跟大家分享“接地气儿”的法律知识。欢迎持续关注“合规小律师”专栏。\"},{\"para\":\"下篇专栏文章预告：《揭开律所合规业务的面纱》\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"为什么很多坚持了好几年的异地恋，重聚以后反而分手了？\",\"content\":[{\"para\":\"我没谈过异地恋，不过刚好前不久看到一个讲这件事情的研究，供题主和遇到类似情况的人参考。\"},{\"para\":\"先来看看，异地恋之后的团聚通常会是什么样的。\"},{\"para\":\"如果你遇到了“终于结束异地恋却不适应两个人的生活”这种情况，可以完全放心，有这种感觉是很正常的，你不是一个人，拥有一段异地恋，因为异地而分手，结束异地而重聚，重聚之后反而分手，重聚之后最终修成正果……每一天都有很多很多人在经历这些事情，每一种可能的结局其实都是正常的。\"},{\"para\":\"每一段关系都是流动的，变化的，关系中会存在一些“里程碑”或者说是“转折点”，所谓的“转折点”，是指一些会影响到关系走向的重要事件，在经历过“转折点”之后，亲密关系通常会发生一些变化，往往既有积极的、令人开心的部分，又有消极的、让人不舒服的部分。就亲密关系而言，一些常见的“转折点”通常会包括表白、恋爱关系的确立、两个人之间的第一次性爱、订婚、同居、结婚、发现怀孕、生孩子等。另外，我的一对朋友还和我讲到过，对于他们两个人的恋爱来说，最“特别”的一个转折点是两个人第一次剧烈的争吵，据他们所说，“放下架子大吵一架之后，感觉彼此之前更加亲密和默契了。”\"},{\"para\":\"在异地恋中，结束异地的团圆是一个很重要的转折点。并不是所有的异地恋情侣都有机会经历这件事，一部分情侣已经在异地过程中分手了。团聚这个转折点多数情况下带来的积极影响居多。通常，结束异地的亲密关系会显得更加稳定，这份稳定性也会让关系中的双方加深对这段关系的承诺。不过，多数转折点给关系带来的影响都是有好有坏的。重聚这件事对恋爱的带来的重要挑战之一就是——朝夕相处的伴侣们需要开始处理异地阶段对这段关系以及对对方的“理想化”了。\"},{\"para\":\"具体来说，在分隔两地的时候，饱受相思之苦的伴侣双方都很可能对“重聚”抱有一些美好的期许与幻想，而这些幻想很可能是不切实际的。当双方最终团圆，现实会一点一点把一些期待打破，这显然不会是一个轻松愉快的过程，可能会充满了失望、沮丧、怀疑、指责……对关系造成很大的冲击。一些能够从异地恋走到团聚的伴侣可能会在分离的阶段认为，“我们之间确实有不少问题，不过也有一些好事儿呀，等到团聚了，绝大多数问题都不再是问题了，生活会变得无比美好！”而等到真的团聚了，现实可能是，异地阶段的一多半矛盾解决掉了，可是又冒出来一些新的，总体来说问题减少了团聚之前的一半，可是具体个体预期的“绝大多数”还是有很明显的差距。\"},{\"para\":\"这种情况下，相比于关系中的矛盾本身，两个人失落感和怀疑感可能会对关系带来更大的挑战。另外，异地恋其实也可能有一些“好处”，比如，独处的时间和更加自主的安排，再比如，双方都会很珍惜短暂的相聚时间，所以会显得更加甜蜜。而团聚则可能“剥夺”掉异地恋的这些好处，这也会给恋爱中的个体带来一些潜在的负面体验。\"},{\"para\":\"美国的一些研究者调查了美国军人和伴侣从团聚到重逢的变化（通常是已婚而非恋爱状态），他们发现，重聚的夫妻需要重新确定双方在关系中的角色（谁做饭，谁做家务，谁接送孩子），需要重新调整边界（两个人是否要告诉对方手机密码或者社交媒体的密码），甚至需要重新分配权力（看电视的时候谁掌握遥控器，外出吃饭谁点菜，遇到分歧听谁的），而且，对于军属来说，团聚简直就像分离一样让人感到充满压力，很多时候还会对伴侣感到陌生……\"},{\"para\":\"另外一项针对美国地区本科生的研究项目主要调查了未婚异地情侣在团聚之后，他们的恋爱关系发生的变化（Stafford, Merolla, & Castle, 2006）。参与研究的本科生们所报告的关系变化包括以下几方面：\"},{\"para\":\"另外，研究者们还问了问这些被调查的人——团聚之后会不会怀念异地恋的时候呀，如果会的话，哪些方面是你所怀念的，这些本科生的回答如下：\"},{\"para\":\"下面的这个表格是从原始文献里摘出来的更完整的数据，供参考：\"},{\"para\":\"\"},{\"para\":\"补充说明：在这个研究中，一半人在异地恋阶段分手了；走到团聚的情侣中，有大约三分之一在团聚之后的三个月内分手了。\"},{\"para\":\"82%的受访者明确表示，对于他们来说，团聚这件事既有积极的部分也有消极的部分，大家享受着恋人的陪伴，同时也怀念着异地恋时候的自由自在——有这种感觉是完全正常的。同时，大家也表示，异地恋和团聚的整个过程让他们明白了很多事情，比如更加了解自己，或者更加了解对方，又或者是对双方的关系有了更清晰的认识，不管恋情的结果如何，这些领悟都是人生之路上的珍贵收获。\"},{\"para\":\"以上，就是调查研究所呈现的异地恋之后的团聚。\"},{\"para\":\"接下来说说情侣们可以考虑的应对方法。\"},{\"para\":\"首先，两个人都可以参考一下别人的相似经历（和有这种经历的朋友聊一聊，或者参考相关的调查报告），得知“团聚之后略感糟心”是正常的，也就会慢慢打消掉一些不切实际的期待，双方心态都会更加平稳，在冲突矛盾面前也会给关系留有余地。\"},{\"para\":\"其次，如果恋爱中的双方或者其中一方确实感到了强烈的不适，两个人可以一起来讨论看看究竟哪里出问题了，也许可以考虑适当拉开距离。如果是同居情侣的生活习惯不合拍，可以考虑分开住；如果是一方很忙，时间排不开，可以调整约会的频率；也许这些安排可能不太符合团聚之前的期待和想象，但是给自己一个缓冲去适应关系的新阶段，也许是有帮助的。\"},{\"para\":\"第三，从异地到团聚，似乎很多情侣都需要经历一个“重新建立关系”都过程，你们当初是怎么相爱的呢？你们是怎样一点一点相互了解建立默契的呢？可以回想一下之前的经历，带着当初的兴奋好奇和小鹿乱撞的忐忑重新认识一下对方，也让对方认识一下自己。从这个角度来说，处理一段恋爱关系在“后异地阶段”可能出现的问题，最重要的工作几乎等同于亲密关系的日常维护，比如要注重交流，养成良好的沟通模式，比如要坚定坦诚地表达自己，同时尊重对方，比如双方都要记得一些特别的纪念日，营造关系中的仪式感和意义感……在恋爱或者婚姻的各个阶段，这类基本维护通常是重要且有效的。\"},{\"para\":\"回答结尾例行说明\"},{\"para\":\"最后，需要说明的是，每个人都是完整的、独特的、复杂的个体，每一段关系也都是不可复制的，恋人们所遇到的甜蜜与挑战都独一无二。在查看了问题日志之后，我发现题主保持匿名，也没有留下更多信息，因此选择比较宽泛地回答，其中的分析都来自于研究调查，给出的建议未必适用每一对情侣。在真实的关系中，最重要的不是这些经验和推论，而是两个人都敞开心扉勇敢探索，一起走一段特别的旅程。\"},{\"para\":\"如果对研究特别感兴趣，可以参考这篇论文：\"},{\"para\":\"Stafford, L., Merolla, A. J., & Castle, J. D. (2006). When long-distance dating partners become geographically close. Journal of Social and Personal Relationships, 23(6), 901-919.\"},{\"para\":\"七夕快乐，无论单身还是恋爱，希望每个人都可以得偿所愿。\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"职场中不懂「专业」的人，迟早会被淘汰\",\"content\":[{\"para\":\"做面试官是件很有意思的事，你不知道哪个问题会逗你捧腹，哪个奇葩能惹你发怒。\"},{\"para\":\"就像我压根没想到，在北京难得一见的好天气里，一次预期良好的面试被几个问题给搞砸了。\"},{\"para\":\"1.Hello，专业小姐\"},{\"para\":\"今天面试了一个FPGA工程师，信号与信息处理专业研究生，因为还算是老乡，我尽量表现出超出自己帅气外表的和蔼。\"},{\"para\":\"一瞅期望薪酬还不低，肯定是个专业人士了，我这个技术门外汉还能说啥？\"},{\"para\":\"自我介绍完。\"},{\"para\":\"我真想说，姐姐，那你还是在这家公司好好干吧，能给你这么高薪水的公司，碰上也挺不容易的。\"},{\"para\":\"再一看，简历自我评价写着：精通verilogHDL语言，熟悉FPGA开发流程，具有良好的专业素养和较强的学习能力。\"},{\"para\":\"好辣眼睛啊！\"},{\"para\":\"\"},{\"para\":\"2. 什么是「专业」？\"},{\"para\":\"专业是在某领域持续学习的状态和结果。如果拿到研究生学位，坐吃山空啃老本也能算「专业」，那我们都去混个研究生学位得了。\"},{\"para\":\"真正专业的人，应该是紧跟本专业内新知识、新技术动态，并运用到实际问题解决，能在本领域的研究项目中发挥主要作用，乐于分享知识经验，从而在本专业内达到融会贯通的能力和专业权威的影响力。\"},{\"para\":\"一个连自己专业都讲不清楚的人，离专业还差着好大一段距离吧？\"},{\"para\":\"首先，连做的是什么专业都讲不清楚，说明她的概念思维能力是有欠缺的，她应该没有在工作之余从宏观的角度思考过工作。满脑子整天思考工作的人，不会讲不清楚自己做的是什么。\"},{\"para\":\"概念思维能力是解决问题必用到的一个重要思维能力，如果这方面能力不足，很难想象她会是一个有解决问题能力的人。\"},{\"para\":\"而且，说不清楚自己专业相关领域的技术，连同事做什么也不知道，怎么证明她有持续学习的动机？这也能叫专业？\"},{\"para\":\"我们知道大学的学习多是基础理论学习，和实际工作相去较远。在工作中还要围绕专业领域持续学习，才能成为专业人士。\"},{\"para\":\"比如我们公司的Mechanical工程师Shaun，会同时和技术创新部、硬件部的同事沟通学习。不仅从结构角度知道如何设计，还知道前端的技术原理，所以他在我们公司成长也是最快的，也是Mechanical领域的核心主力。\"},{\"para\":\"我相信，如果你抱着学习的态度，多关注一下你的业务上下游，也能很快成长为专业人士。\"},{\"para\":\"\"},{\"para\":\"3. 因为专业，所以「专业」吗？\"},{\"para\":\"那么，学习了很多，在公司内最懂本专业领域的知识，就是专业了吗？\"},{\"para\":\"这还要看你是否有「战略思维」，是否能够着眼公司整体目标，给出专业可行的建议。\"},{\"para\":\"如果你无论外部环境如何变化，都以不变应万变，可就是闭门造车了。\"},{\"para\":\"公司的运行有一个整体目标，更高的市场占有率、更高的营收和利润，归根结底，那就是提高公司运营效率。\"},{\"para\":\"如果你的专业着眼点不是以这个目标为基础，而是刷存在感的“专业”，早晚会被淘汰。\"},{\"para\":\"我们公司的某股东，有个一流的律师团队，从法律的专业度上，也是国内一线律所的水平。\"},{\"para\":\"不知道是出于刷存在感或是规避风险，在每次新股东进入谈判增资协议时总锱铢必较，其他股东都没意见时，他还要字斟句酌翻来覆去。\"},{\"para\":\"站在他的公司角度，他在权限范围内保证了条款对他公司利益保障的最大化，确实很专业化。\"},{\"para\":\"可他没有意识到斤斤计较带来冗长的沟通成本，都要化成公司的时间成本。在资金链吃紧的情况下，错失时间优势，可能就被对手赶超，原本翻几番的估值或化为泡影所有的股东都会利益受损。\"},{\"para\":\"而他关切的小小风险，他自己也知道发生的几率很低，其他股东甚至根本不 care。\"},{\"para\":\"\"},{\"para\":\"商业的合作，其实就是人的合作。\"},{\"para\":\"你更多需要去考虑的应该是「如何让自己投资的项目迅速实现扩张，实现真正的利益最大化」，而不是确保要比其他股东拥有更多的权益。\"},{\"para\":\"同样作为律师，我们公司新股东请的某一线企业并购律所的律师，就会抓主要矛盾，对非核心的问题便宜行事。\"},{\"para\":\"我们自己律师对他们也是赞赏有加，认为这种能够抓住主要矛盾而非一味强调己方利益的行为，才是真正的「专业」。\"},{\"para\":\"无论人力、财务、还是法务，你作为企业内部的乙方，除了要明确风险，不应该以自己专业上的优势挟持公司的利益刷自己的存在感，你应该在可控的范围内，抓大放小，不要事无巨细上纲上线。\"},{\"para\":\"毕竟对被投资的公司来说，保证资金链不断，业务扩张，估值翻番，作为老股东难道不是受益方吗？\"},{\"para\":\"所以，在组织内，只有知道组织的首要目标是什么，自己能够在本专业内为目标的实现提供专业和便利的服务才是真正的「专业精神」。\"},{\"para\":\"一味的刷存在感，只能提高组织内耗，降低组织效能。\"},{\"para\":\"那么，你够「专业」了吗？\"},{\"para\":\"想成为专业人士，除了学习还要有好的职业规划，欢迎关注小红老师的职业规划课 ▼\"},{\"para\":\"如何找到一份适合自己的好工作？\"},{\"para\":\"#话题互动# ：你眼中的「专业」是怎样的？\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"七夕过后，妹子说这是她见过最独特的表白方式\",\"content\":[{\"para\":\"七夕情人节快到了，作为单身汪、单身喵的你，看着别人成双成对\"},{\"para\":\"\"},{\"para\":\"而你还是孤单一个人，形影相吊\"},{\"para\":\"\"},{\"para\":\"如果有了心仪的 Ta，趁七夕情人节，赶紧向他表白吧。\"},{\"para\":\"问题来了，该如何向心仪的 Ta 表白呢？该如何表白呢？如何表白呢？\"},{\"para\":\"........思考三分钟.....\"},{\"para\":\"........思考三小时.....\"},{\"para\":\"........思考三天....\"},{\"para\":\"........思考三个月.....\"},{\"para\":\"........思考三.........\"},{\"para\":\"难道你要思考三年才能表白？不用思考了，我们既然是表哥表妹，那就用 Excel 这个养家糊口的生产力工具，动手做一个计算器送给 Ta。来，先来看效果\"},{\"para\":\"注：\"},{\"para\":\"本计算器由《“偷懒”的技术：打造财务 Excel 达人》读者群 通州|天山湖 制作，在此表示感谢。\"},{\"para\":\"\"},{\"para\":\"上面的计算器是通过设置单元格边框和底色来制作的，但这还不足以打动 Ta，我们再加点功能，用数字来表白：\"},{\"para\":\"\"},{\"para\":\"除了如上图中在单元格直接输入数字外，也可以在单元格中输入简单的算式，比如，你可以问 ta:\"},{\"para\":\"今年七夕是 2017 年 8 月 28 日，距离去年 3 月 26 日多少天？\"},{\"para\":\"Ta 肯定答不上来，你可以很老练的说：\"},{\"para\":\"在 Excel 中，日期就是数字，它们可以直接相减的，我们用 Excel 来计算相差多少天，我在 Excel 里做了一个计算器，我们用它来算算：\"},{\"para\":\"\"},{\"para\":\"就这样，你很自然地就表白了。\"},{\"para\":\"如果你懂 VBA 的话，还可将计算器做成点击各数字单元格和运算符单元格可在显示屏单元格录入数字并运算的功能，那样就更完美了。\"},{\"para\":\"制作这计算器，用到了三个功能\"},{\"para\":\"1、设置单元格格式\"},{\"para\":\"2、条件格式\"},{\"para\":\"3、自定义格式\"},{\"para\":\"下面介绍一下如何制作这个计算器。\"},{\"para\":\"一、先来看一下外观如何制作\"},{\"para\":\"计算器的外观所用的功能我们每天都在用，那就是设置单元格的边框。\"},{\"para\":\"Step1：选定某单元格区域，先将单元格设置为灰色，然后，设置上边框和左边框的亮色\"},{\"para\":\"\"},{\"para\":\"注意：边框线条颜色要设为白色。\"},{\"para\":\"设置后效果如下\"},{\"para\":\"\"},{\"para\":\"Step2：设置下边框和右边框的为暗色\"},{\"para\":\"\"},{\"para\":\"设置后效果如下图：\"},{\"para\":\"\"},{\"para\":\"设置好后，就有浮雕凸起的效果。\"},{\"para\":\"如果我们将左边和上边设置为暗色，右边和下边设置为亮色，则为凹陷的效果：\"},{\"para\":\"\"},{\"para\":\"其他的一些制作细节比如合并单元格、单元格底色的设置就不一一介绍了。请大家自己设置。\"},{\"para\":\"我们还可用这种方法来模仿制作窗体。\"},{\"para\":\"\"},{\"para\":\"二、如何让输入指定的数字显示为特定字符如何让输入指定的数字显示为特定字符比如输入 520，显示为”我爱你“呢？\"},{\"para\":\"方法 1：使用上一篇文章所用到的自定义格式。\"},{\"para\":\"但这种方法最多只能显示三条表白。\"},{\"para\":\"自定义格式分为四节，中间用分号隔开：\"},{\"para\":\"比如下图，正色显示为蓝色，设千位分隔数，二位小数，负数显示红色，设千位分隔数，二位小数，零值显示为短杠 -，其自定义格式为：\"},{\"para\":\"\"},{\"para\":\"自定义格式还可做简单的条件判断，用于条件判断时是下面的语法格式\"},{\"para\":\"[条件 1]满足条件 1 的格式；[条件 2]满足条件 2 的格式;不满足条件 1 和 2 时的格式；文本格式\"},{\"para\":\"比如要将大于等于 80 的数字显示为优秀，60-80 的显示为及格，小于 60 的显示不及格，如果是文本则显示“输错了，请输入数字”，则使用下面的自定义格式：\"},{\"para\":\"\"},{\"para\":\"方法 2：使用条件格式\"},{\"para\":\"由于自定义格式，最多只能显示三个条件加一个文本格式，并且只能用于简单的条件判断，有一定的局限性，要突破四个条件的效果，我们可以结合使用条件格式这一功能。\"},{\"para\":\"开始选项卡 -- 条件格式，然后按下图的方法依次建立条件判断的规则\"},{\"para\":\"\"},{\"para\":\"如果要根据包含关系判断，比如只要输入的数字中包含 520 都显示“我爱你”，则条件判断规则如下：\"},{\"para\":\"\"},{\"para\":\"建立后，条件规则如下：\"},{\"para\":\"\"},{\"para\":\"三、知识点回顾\"},{\"para\":\"1、单元格格式\"},{\"para\":\"将单元格的上边框和左边框设为的亮色（较浅的颜色），下边框和右边框设为暗色（较深的颜色），则显示为浮雕凸起的效果。将上边框和左边框设为的暗色，下边框和右边框设为亮色，则显示为凹陷的效果。\"},{\"para\":\"2、自定义格式\"},{\"para\":\"自定义格式分为四节，中间用分号隔开：\"},{\"para\":\"正数格式;负数格式;零值格式;文本\"},{\"para\":\"自定义格式还可用于简单的条件判断，用条件判断只能有三条。用于条件判断时，其语法格式为：\"},{\"para\":\"[条件 1]满足条件 1 的格式；[条件 2]满足条件 2 的格式;不满足条件 1 和 2 时的格式；文本格式\"},{\"para\":\"3、我们可以联用自定义格式和条件格式，做出更多更丰富的显示效果。\"},{\"para\":\"本文首发于微信公众号：Excel 偷懒的技术\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"昨晚和你约会的那个人，是不是比照片丑多了？\",\"content\":[{\"para\":\"适逢七夕佳节，介绍一篇实用研究，作者是 Hancock 和 Toma[1]。如果现实已经是个看脸的世界，那约会平台犹有过之——你只能看到对面的少许信息，照片即是其中最最显著的一点。颜好？来个钩钩；颜不好？过。大家勾心斗角，努力把自己修饰得好看一点点。可是，修饰过了头，照片便成了照骗。那么，男方女方，哪一方照片更可信呢？\"},{\"para\":\"通过线上线下发广告，研究者招募了 54 名约会平台的用户参与研究[2]。除了平台上的照片，研究者还为参与者现拍了照片。参与者回答问题：你觉得自己的照片有多准确？5 分代表非常准确，1 分代表非常不准确。接下来，研究者从某大学招募了 40 名学生充当“判官”，根据现拍照片，判断参与者照片的准确程度。同样是 5 分最高，1 分最低。\"},{\"para\":\"结果如何？自评方面，男女没有显著区别，都在 4.3 分左右。他人评价方面，他人的评价明显要比自评低，平均只有 3.3 分。此外，学生给男性照片准确度的评价明显要比女性高：给男性的评分平均在 3.5，给女性的只有 2.9。无论是男生还是女生，普遍都认为男性照片的准确度更高。从这个研究看，两性在平台上发的照片准确度确实有差异。\"},{\"para\":\"研究者还让学生评估，照片是否有以下 9 个方面的不一致：外貌方面 6 点，体重、牙齿、皮肤、发长、发型和年龄；摄影方面 3 点，美化、职业摄影和裁剪。结果发现：男性平均有 1.33 项不一致，女性平均有 3 项。男女在哪几个方面的“修饰”差距最明显呢？结果发现：在发型、皮肤、年龄、美化和职业摄影五个方面，女性修饰的比例显著更高。\"},{\"para\":\"最后，研究者统计了哪些方面的不一致会影响学生对准确度的打分。结果显示：在判断男性照片时，体重、发长和年龄会显著影响对准确度的判断；在判断女性照片时，体重、牙齿、发长、发型、年龄和美化都会影响对准确度的判断。不过，这个研究也有以下几个问题：样本量小且集中，不一致分类是否武断、只看照片，等等。期待更多研究。\"},{\"para\":\"[1] 两位研究者在“约会平台造假”这一问题上做了不少其它研究，比如 Toma, C. L., & Hancock, J. T. (2012). What lies beneath: The linguistic traces of deception in online dating profiles. Journal of Communication, 62(1), 78-97. 可供参考。\"},{\"para\":\"[2] 参与者全部来自纽约地区，分散于 4 家约会平台。共有 400 余人报名，研究者随机选出了 54 人。\"},{\"para\":\"参考文献：Hancock, J. T., & Toma, C. L. (2009). Putting your best face forward: The accuracy of online dating photographs. Journal of Communication, 59(2), 367-386.\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"瞎扯 · 如何正确地吐槽\",\"content\":[{\"para\":\"在英美酒吧听到过的搭讪（真人真事！）\"},{\"para\":\"美式：Nice shoes, wanna fuck?\"},{\"para\":\"英式：Will you just... get out of my dreams and get in my bed?\"},{\"para\":\"800 买的奥拓，（注意是八百不是八千，八千可以买桑塔纳了），三大件都还活着，这个档次的车，能用就跟新的没多大区别，换了四个轮子，七七八八加起来大概两千落地，开了两个月，座椅穿了，铁架子膈屁股，就上某宝买个新的驾驶座椅，想着该到货了就把破座椅拆了，结果快递迟迟不到，又要出门，就放个小竹凳坐着开车，好死不死遇到交警，把车扣了，不要了……\"},{\"para\":\"新座椅现在放在阳台上，偶尔上阳台抽烟的时候坐一下。\"},{\"para\":\"坐标云南。\"},{\"para\":\"来云南旅游过的人都知道鲜花饼吧。大街小巷都有卖的，还算比较特色的东西了。\"},{\"para\":\"大一入学前，我喜滋滋的跑去买了四五袋鲜花饼，小心翼翼的放在行李箱的夹层里，想着带到学校里给外省同学尝尝。\"},{\"para\":\"结果开学一来，五个舍友全是云南人。\"},{\"para\":\"第一句：「司马德操之言，徐元直之语，岂虚谈哉？望先生不弃鄙贱，曲赐教诲。」\"},{\"para\":\"// 找到合适的中间人推荐，保持低姿态。\"},{\"para\":\"第二句：「大丈夫抱经世奇才，岂可空老于林泉之下？愿先生以天下苍生为念，开备愚鲁而赐教。」\"},{\"para\":\"// 谈对方的个人职业发展，继续保持低姿态。\"},{\"para\":\"第三句：「汉室倾颓，奸臣窃命，备不量力，欲伸大义于天下，而智术浅短，迄无所就。惟先生开其愚而拯其厄，实为万幸！」\"},{\"para\":\"// 谈企业愿景和社会责任，继续继续保持低姿态。\"}]},{\"title\":\"小事 · 我能想到最浪漫的事\",\"content\":[{\"para\":\"* * *\"},{\"para\":\"知乎日报会和你一起慢慢变老\"},{\"para\":\"晚安\"},{\"para\":\"* * *\"},{\"para\":\"高二的时候，刚刚和喜欢了很久的人在一起，他是农历正月二十九的生日，前一个月开始就在想该给他准备点什么礼物。\"},{\"para\":\"一天看到学弟在弹钢琴觉得好像还挺棒的诶！就让学弟每天晚上放学都教我弹一个小时的琴，那时候总是骗对方说放学有事要赶快回去，还惹得他挺不高兴的。\"},{\"para\":\"到了生日那天，装作什么事都没有，陪他去买了蛋糕就说是生日礼物了。高中我是一个学生社团的社长，于是打了一份学校千人报告厅的使用申请交到团委去了，说要排练节目拍片子什么的。\"},{\"para\":\"晚上放学陪他和同学们分完蛋糕就假装回班上自习，其实跑到千报去布置场地了，把大三角钢琴推到舞台中间，和灯光老师把射灯打好就把老师们想法子支走了，然后拿出藏好的蜡烛在台子上开始摆「XX，生日快乐」，现在想想简直是作大死，被老师发现我在千报玩火肯定很严重。\"},{\"para\":\"眼看第一节晚自习都要下课了还没摆好，就让来帮忙的同学继续摆，我去他们班找他，等摆好了给我发个短信。\"},{\"para\":\"那天还下着特别大的雨，我跑到他们班门口把他叫出来让他陪我出去走走\"},{\"para\":\"「下这么大的雨你走啥？」\"},{\"para\":\"「走走嘛，雨中散步也很有情调啊。」\"},{\"para\":\"于是我俩就打着伞在操场上一圈一圈的走，我因为内心的紧张话都说不利索，有一搭没一搭的说着，甚至还问他妈妈最近怎么样，心里想着这俩人怎么还没好啊。\"},{\"para\":\"终于收到了短信「好了，来吧。」\"},{\"para\":\"然后我和他说「宝贝你闭上眼睛，我带你去个地方。」\"},{\"para\":\"想象一下这个场景，他拿着伞我抱着他，往千人报告厅走去。\"},{\"para\":\"一步步上楼梯的时候他说：\"},{\"para\":\"「这千报吧？」\"},{\"para\":\"「你咋知道！！！」\"},{\"para\":\"「我又不傻……」\"},{\"para\":\"「那你还是闭着。」\"},{\"para\":\"我把他放在一千人观众席的最中间一排的最中间的位置上\"},{\"para\":\"「我喊你睁眼之前不准睁哦。」\"},{\"para\":\"然后飞快的跑下台阶，一个箭步窜上舞台在钢琴前坐下\"},{\"para\":\"「可以睁开眼睛了！！！」\"},{\"para\":\"那一瞬间，我觉得自己是理查德克莱德曼，是瓦拉迪斯劳马克西姆席皮尔曼，弹了一曲特别蹩脚又炫技的改编版生日快乐歌。\"},{\"para\":\"「十五岁生日快乐！！！」\"},{\"para\":\"弹完之后我对着淹没在黑色观众席里的他大喊一声，又立刻跑了下去，他直直的看着我，眼泪留个不停，抱了我好久好久。\"},{\"para\":\"最后，我们收拾那堆蜡烛收拾了两个小时。\"},{\"para\":\"\"},{\"para\":\"几年前，和男朋友刚在一起两三个月的时候，他生日。\"},{\"para\":\"我没什么钱嘛，很穷很穷，就为他写了一首歌，把伴奏藏在他笔记本里 C 盘第一个文件夹一直点下去的最后那个文件夹里。\"},{\"para\":\"然后我把歌词写在一张信纸上，交给他的室友，嘱咐室友一定要零点准时交给他。\"},{\"para\":\"零点的时候他一头雾水地同时接到我的电话和室友交给他的信纸，在我的远程指导下点开了 C 盘里第一个文件夹里的第一个文件夹里的第一个文件夹......里的伴奏。\"},{\"para\":\"他就读着歌词、伴着电脑播出的伴奏、听着电话里我唱完了一整首歌。\"},{\"para\":\"那些歌词都是我们一起经历过的事情，他当时感动坏了！\"},{\"para\":\"乔\"},{\"para\":\"那个时候他还在追求我，各种胆大心细不要脸，不喜欢不反感，但当时我在上海，他在北京，我直接没考虑过他，更多的是看不上他，在众多追求者中，他实在太不起眼，朋友都佩服他的勇气。\"},{\"para\":\"有一天，他到了北京八达岭长城在好汉坡，给我打了个电话兴奋的说：我喜欢你，就和这长城的城墙一样坚固，和这长城的砖头一样踏实，以前不明白为什么长城可以活这么久，今天我明白了，我没办法帮你修一座长城，但秦始皇让长城能留到今日就是为了让它来承载我对你的爱吧。 我回答说：我跟你不熟。当时他就直接挂了电话。一个月后，收到他从乌镇寄过来的明信片：“我在乌镇邮局的公共墙壁上，给你留了一张明信片，上面有一句你不喜欢的话。一个多月后乌镇景区龙形田里的薰衣草就都开了，如果这张明信片能等到那个时候繁花的孤独，希望能够迎来你紫色的亲睐。“ 不知道为什么，我心里没怎么想着他，但会一直惦记着那张明信片和这句话，还在想那句我不喜欢的话是什么。\"},{\"para\":\"三个星期后的周末，我和姐妹去乌镇玩，在乌镇邮局内的纪念墙上，我很快就找到了那张明信片。\"},{\"para\":\"文字内容是：雾起时 / 你就在我怀里 / 这乌镇充满了湿润的芳香 / 雾散后 / 却已是一生 / 镇空水静 / 只剩下那在千人万人中 / 也绝不会错认的背影。 天呐，在熙熙攘攘的人群中，在众多的明信片中，我看到在墙壁上歪歪斜斜订着的这张明信片，三行漂亮的行楷，我真的深深的震撼了，眼睛湿润了。\"},{\"para\":\"他知道我喜欢去乌镇，他知道我喜欢薰衣草。他应诺给了乌镇邮局的卫生员了 521 块钱为他看着那张明信片 2 个月内不被覆盖和掉落。他是搞计算机的工科男，那个时候他的公司非常艰难，他压力非常大。\"},{\"para\":\"2015 年复活节前后，我和男票来到了西班牙的 Ibiza 小岛度假，那是我俩第一次单独长途旅行。\"},{\"para\":\"这个岛是欧洲著名的 party island，标准的夜生活就是喝酒、跳舞、享受音乐和海鲜，然后和另一半共度良宵——\"},{\"para\":\"是夜，凉风习习，海浪声声，月明星稀，远处有隐隐约约的 blue jazz 传来，气氛真是美妙。\"},{\"para\":\"我和男票搬了两把椅子，坐在酒店房间的阳台上，看着月色下的沙滩，吹着小风喝着小酒，开始聊一些各自小时候的故事。\"},{\"para\":\"聊着聊着，惊喜地发现我俩都非常爱好文学，以前也都写过一些散文、小说，发表在了各自的博客里。\"},{\"para\":\"于是我说：“我想看你的文章。”\"},{\"para\":\"然后，男票就登陆了好久不用的博客，选了一篇他写的散文，开始用非常温柔的声线——读！给！我！听！\"},{\"para\":\"我记得那天，房间里台灯的光线有些昏暗，就着阳台上的月光，男票半边脸的轮廓隐在窗帘后的阴影里——他念给我的那篇散文，讲述的是自己以前在山区支教时候的故事：而那时的他，是几十个山区孩子的语文老师。\"},{\"para\":\"有那么一瞬间，我仿佛回到了小学的语文课堂，发呆一样看着文质彬彬的“老师”，用抑扬顿挫的语调读着美文，思绪也跟着他的文章，从西班牙的小岛，飞到了万里之外的大山里……\"},{\"para\":\"读罢一篇，他笑着说：“该你了。”\"},{\"para\":\"于是我也翻出了博客里很久以前的文章，开始跟他朗读起了自己的故事。\"},{\"para\":\"就这样，你读一篇，我读一篇，我俩都忘记了时间的流逝……\"},{\"para\":\"等我俩都发觉有些困意时，一抬头，正看到朝阳从海平面上缓缓升起。\"},{\"para\":\" \"},{\"para\":\"直到现在，我仍然时不时想起那个浪漫的夜晚——异国他乡孤男寡女共处一室，有酒精、有音乐，四处都是寻欢作乐的人们……然而，我们只是无欲无求地朗读着彼此的散文，整整一夜，直到天光泛白。\"},{\"para\":\"爱情的美妙之处大概就是一个矫情的文青找到了另一个矫情的精神伴侣，从那天起，我开始相信电影《朗读者》里的某些情节是可以真实存在的。\"},{\"para\":\"没错，我们就是那种至今还会用钢笔互相写信的人。（图为男票朋友圈）\"},{\"para\":\"\"},{\"para\":\"背景：我和我媳妇，各自都是对方的初恋，相恋六年，结婚一年。\"},{\"para\":\"最近想买个蓝牙耳机，在网上选来选去看中了苹果的 AirPods，我正好用的苹果手机，简直是绝配。正准备下单的时候，忽然想到 28 号就是七夕了，还没给媳妇准备礼物。于是在网上找礼物，看中了一条项链，两千多。这样一来就陷入矛盾之中，如果买了项链，就没法买 AirPods 了（工资不高，见笑）。后来一咬牙，媳妇重要，下单了项链。耳机等下次发工资了再买吧。\"},{\"para\":\"重点在后面。\"},{\"para\":\"昨天项链到货了，看了看还算满意。离七夕还有一段时间，我得先把项链藏起来，到时候再拿出来给媳妇。于是在家里找藏东西的地方。家里有一个柜子是专门放冬天的厚被子的，我翻了翻看看藏在那里面行不行，结果翻到了一个盒子，打开之后你猜是什么？全新的 AirPods！！！盒子里还有一张纸条：老公情人节快乐！我当时那个心情啊，妈的我上辈子是拯救了地球吗？冷静下来后，回想起来前几天，我在网上选耳机的时候，媳妇就在旁边，还问我哪个好，我就随口说了句我喜欢苹果的但是有点贵，原来她都记在了心里，还给我准备了这个惊喜。然后我默默的把耳机放在原处，找个其他地方把项链放了起来。\"},{\"para\":\"我当然不会告诉媳妇我已经发现了她的秘密，我只会静静地等到七夕节那天，等她拿出礼物，看到我一脸的惊讶。\"},{\"para\":\"对了，媳妇是在网上买的耳机（别问我怎么知道的，盒子里有发票），1488，官网才 1288，这个败家媳妇儿！\"}]},{\"title\":\"杀戮起时，皆以爱的名义\",\"content\":[{\"para\":\"《我们的父辈》—— 杀戮起时，皆以爱的名义\"},{\"para\":\"这是一部德国制作的迷你剧，共三集，每集 90 分钟，制作精良甚至超过电影。当各战胜国都在隆重盛大的庆祝胜利之时，有必要静下心来看看今天的德国人是如何反思这场战争的。\"},{\"para\":\"同样是一位德国伟大的科学家和哲学家 莱布尼兹 在他的著作《神义论》中有一句最有争议的话：\"},{\"para\":\"“我们现在这个世界是所有可能世界之中最好的世界”\"},{\"para\":\"在这句话之后我想再加上该剧中最核心的另一句话：战争会让我们展现出人性中最坏的一面。\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"剧情以 1941 年德国入侵苏联前夕作为开端，五个年轻人在完全不了解战争时或自愿或被迫的卷入了这场灾难。他们是孩童时代的朋友，在启程的前夜载歌载舞，饮酒狂欢，仿佛只是去参加一场华丽的冒险。\"},{\"para\":\"其中有对纳粹有着坚定信仰的国防军哥哥和对纳粹抱有怀疑的弟弟\"},{\"para\":\"\"},{\"para\":\"有渴望成为明星，热爱生活的歌手\"},{\"para\":\"\"},{\"para\":\"励志服务人民和元首的护士\"},{\"para\":\"\"},{\"para\":\"还有曾绝望说服父母离开德国的犹太人\"},{\"para\":\"\"},{\"para\":\"直到战争将他们拆散。\"},{\"para\":\"德国一直以来思想家、哲学家层出不穷，文化艺术精英群星璀璨，应该说是最具有理性精神和反思能力的一个民族。\"},{\"para\":\"和其他描述二战的电影电视不同，四个半小时一口气看下来，我们也许很难感觉到仇恨和愤怒，不能很清楚的分辨什么是正义和邪恶，更多的空虚和彷徨。\"},{\"para\":\"但我们能体会到，整个德国深深的认识到了战争的错误和可怕，并为此感到负罪和愧疚。\"},{\"para\":\"也有人会说，德国人狡黠，试图模糊罪与善的边界来为自己开脱。对于在二战中承受了巨大痛苦和灾难的中国人来说，这样想也没有什么不妥之处。\"},{\"para\":\"\"},{\"para\":\"但德国的理性依然值得世界上任何一个国家和民族尊敬和佩服。\"},{\"para\":\"毕竟容易的是为自己开脱，难的是面对罪责。\"},{\"para\":\"同样作为战争的发动者，日本人也经历过反思，也明白战争给人类，尤其是本国人带来的灭顶之灾，以至于几十年来一直致力于限制军国主义抬头和避免战争的制度改革。然而这种反思却很局限，因为罪责至今无人承担，既无法归咎于天皇，也不能归咎于人民，就这样一直回避着，拖延着。不承担罪责，就谈不上反省。\"},{\"para\":\"有趣的是反观今天的战胜国，不说英法，单说在这场战争中损失最大的中俄两国，本是最该痛恨战争，反对暴行的民族，却诡异的升起一支崇尚暴力、标榜战斗的“青年力量”。这股力量让人感到可怕，这是种下仇恨和愤怒的恶果，这股戾气和希特勒和墨索里尼的青年军没有本质区别。\"},{\"para\":\"如果说有纯粹的魔鬼，那就是民族主义的仇恨和愤怒。它和极端宗教一起，是撒旦的左膀右臂，总有人要挥舞起它的大旗来达到目的：激发出我们最坏的一面，教唆我们抛弃人类文明的情感，回到野蛮中去。更加可拍的是，这场我们参与其中的洪流一旦形成，醒悟已晚，只能任其裹挟直到灭亡。\"},{\"para\":\"时至今日，如果有人告诉我们他能让我们的世界变好，请保持怀疑；\"},{\"para\":\"如果有神指明了我们的敌人，请保持怀疑；\"},{\"para\":\"如果有任何人试图让我们仇恨和愤怒，请保持怀疑。\"},{\"para\":\"只有每一个人不把自己的命运交到别人手中，才有可能避免这肉体和精神的毁灭。一旦放手，我们无法选择让自己成为正义的一方，因为杀戮就是杀戮，本无正义可言。\"},{\"para\":\"摘录我特别喜欢的诺贝尔文学奖得主阿列克谢耶维奇老奶奶的一段描写：\"},{\"para\":\"士兵的叙述：我有时在琢磨，倘若我没有参加这场战争又将如何呢？我会是个幸福的人，我会对自己永远不失望。在战斗中我就不会考虑把人打死还是不打死。我总想听东西，睡觉，总有一个愿望——快快结束。那天，我们沿着村边小路回营地，突然窜出一个阿富汗老太婆，她对我们边哭边叫边挥舞拳头。她儿子被打死了，她在诅咒我们。可是她的举动只能唤起我们一种感情，就是送她上西天。现在我双目失明了，没有了眼睛，我想回国后净化灵魂，清除身上的一切污秽。可是有谁能理解我们？\"},{\"para\":\" ——《锌皮娃娃兵》\"},{\"para\":\"最后为在战争和恐怖主义中受害的所有人默哀，《浮士德》中天使用爱击败了魔鬼，这看似荒诞，而也许是最终的解法，如果我们自己不变成魔鬼的话。\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"到台湾就别去高级餐厅了，要吃就去吃这些最地道的\",\"content\":[{\"para\":\"到台湾，绝对不能去高级餐厅吃东西，他们的上海菜不像上海菜，广东菜不像广东菜，总之没有一间是正宗的。至于日本料理，更是气死人，台湾朋友以为好大面子地请我去，指着一块粉红色的鱼，大叫：「Toro！Toro！」其实那并不是金枪鱼的肚腩部份，是一种旗鱼 Kajiki Maguro 的次等鱼，钓到了，旗鱼飞跃，血倒流，白肉变成粉红色罢了。但是尝试解释给他们听，他们立刻发脾气，说你不识货乱讲！\"},{\"para\":\"较像样的还是他们的四川菜，这一点我承认香港一直没有好好发扬，香港吃得过去的四川菜馆不多，台湾每间都有点水准。湖南菜也不错，福州菜更好，香港根本就吃不到福州菜。\"},{\"para\":\"典型的福州菜包有红糟和醋溜。红糟鸡、猪、羊，颜色鲜美，吃进口中，一股酒味，肉松化，是他们至高的文化。如果你不是醉客，那叫他们的醋溜腰子好了。一个腰子切成四大片，整齐地割着花纹，把锅子中的油爆得冒烟时，将猪腰、海蜇皮头、油炸鬼块一齐扔进去，淋上糖醋，即起。腰子入口即化，海蜇头弹牙，油炸鬼吸汁，酸酸甜甜，可吃白饭三大碗。\"},{\"para\":\"谈到他们的白饭，是用一个个的小麻绳篓盛着米，隔水蒸熟。侍者把蒸熟白饭的篓子一挤，香喷喷的一团饭倒在你面前的空碗中，包你没吃过那么好的白饭。\"},{\"para\":\"喜欢吃面的话，福州海鲜面是一绝，用整只的膏蟹，加虾、鱼片、墨斗、蛏子等八九种海产熬了的汤，变成乳白色。在黄颜色的油面煨了一煨上桌，和白饭的水准一样，再次包你没有吃过那么好的面。\"},{\"para\":\"但是来到台湾吃甚么福州东西？最上乘的当然是光顾地道的台湾餐。你向朋友要求，他们即刻抓头皮，因为他们也没吃过台湾餐。台湾没有台湾餐，那不是开玩笑吗？的的确确，一般上只有「青叶」、「梅子」餐厅等台湾小吃，正式的台湾餐，要找到台湾老饕才能找到。\"},{\"para\":\"台湾餐份量很足，一席十个菜，十二个人也吃不完，要是人数少，可叫「半席」，那只有五味。\"},{\"para\":\"头盘的冷热荤是在一个大盘中盛着鲍鱼片，这是不经炮制，把罐头鲍鱼切片，就此而已。多春鱼的柳叶鱼是炸的，有十二尾。五香卷用猪肉、肉猪肝等以腐竹皮包了炸香切片。卤肉，猪的五花腩卤后切片。炸鱼片，当天有甚么新鲜鱼就用甚么鱼炸成一团团地，沾日本丘比婴儿牌的沙律酱吃。林林总总的花样中，最惹人注目的是中间摆的响螺肉，响螺在旧台湾很珍贵，几乎吃不到新鲜的，他们的响螺也不是香港的那么巨大，只是像在日本观光地烧着卖的嵘螺 Sazae，拳头般大，弃其肠壳，只有颗栗子那么小的螺肉，装进小罐头中。上桌时，为表示货真价实，整罐罐头放在盘中，还可以看到未完全打开的铁盖上的锯子痕。\"},{\"para\":\"接下来的菜很特别，名堂叫不出，台湾等基本上是福建菜，汤水特别多。像蒸平鱼，潮州人是用碟子盛，他们的蒸平鱼可以说是「煮平鱼」，用咸酸菜，肥猪肉丝、香菇丝、中国芹菜加红辣椒丝等等蒸之，蒸时用了大量的汤，以大碗分盛后上桌。客人除了吃鱼肉和配菜之外，还用汤匙喝汤；酒徒不喜吃东西，只饮汤，特别合胃口。\"},{\"para\":\"有些菜干脆用整个锅上桌，锅中的东西有点像新界的盘菜，是一层层的。最下面用大粒的蛤蜊铺底，加一层芋头，芋头上铺的是：一层炸过的排骨、一层粉丝、一层白菜、一层猪杂、一层冬菇、一层鱼肉、一层韭菜黄再一层鸡肉、一层蛋卷等等，数之不清，整锅东西加了大量上汤炖个数小时，你说味道鲜不鲜甜？\"},{\"para\":\"海参的做法是用葱、姜、绍酒把海参发了之后，煮鸡汤、猪肉汤，把肉扔掉，留汤煨之；再将猪肚、猪舌、鸭肝、鸭肫、冬笋等爆后捞起，加莲子、切成小块的猪脑拌后炒之，味道错综复杂，绝非红烧海参或虾子海参那么简单。\"},{\"para\":\"上面四种只是副菜，主菜为台湾式的佛跳墙，单单是材料有：一、鱼翅。二、鱼唇。三、刺参。四：干贝。五、鲍鱼。六、鱼肚。七、火腿。八、猪蹄尖。九、猪蹄筋。十、猪肚。十、羊肘。十二、鸭。十三、鸡。十四、鸡肾。十五、鸡蛋。十六、冬菇。十七、冬笋。十八、红萝卜。十九、豉油。二十、酒。二十一、茴香。二十二、冰糖。二十三、桂皮。二十四、葱白。二十五、姜。二十六、猪油。炮制方法和时间不赘，已知是绝品。\"},{\"para\":\"最后有台湾炒面和炒米粉，其实只是这两样，已经饱腹。\"},{\"para\":\"台湾菜的师传已经卖少见少，能够享受一次，是福气。\"},{\"para\":\"到台湾如果吃不到台湾菜的话，那只好吃街边小吃，包括有：卤肉饭、排骨饭、牛肉面、苦瓜排骨汤、切仔面、蚝仔面线、烤香肠、杠丸汤、猪血汤、金菰鱿鱼羹、金不换炒羊肉等等，我的口水已经流个不止……\"},{\"para\":\"一次去台湾，为了谈生意，被人家请到「来来酒店」的沪菜厅。主人客气地问道：太太呢，怎么不一齐来？我黑口黑面地：「她去吃大排挡，她比我幸福。」\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"哪种文化是江南水乡和魔幻之都重庆都必不可少的？\",\"content\":[{\"para\":\"这个题目，有一点潜藏的野心，我觉得挺有意思。这个野心就是：中国目前好像并没有一种（或几种）非常知名，让所有人都有共识的所谓“桥文化”，除非……咱们自己造。\"},{\"para\":\"其实，所有“文化”体系的诞生都始于人们有目的的归纳总结，因为“野生”的文化是一团乱麻的，只有学究们发明出一个能够解释现象的通用框架，这些野生的文化才能够被讨论。一个清晰可行的动机，有时可能就是成功的一半。\"},{\"para\":\"这个题目也是一样。到目前为止，我实在想不出一个人尽皆知的“桥文化”来。因为桥是一种交通设施，功能性特别强、容易损毁，与人的生活存在一定的距离，也不太可能有私人产权的桥。所以不像建筑，桥这种构造物很难演化为一种文化上的显学。\"},{\"para\":\"但其实仔细想想，还是有一些有潜质的备选品的，也许经过大家共同的努力，真能“发明”出一些“桥文化”也说不定……\"},{\"para\":\"一、“汴水虹桥”和福建虹桥\"},{\"para\":\"\"},{\"para\":\"说到中国古代最有传奇色彩的桥，肯定就是上面这个没跑了——《清明上河图》中的“汴水虹桥”。\"},{\"para\":\"说它传奇，是因为这座虹桥早已随着宋朝一起泯灭，宋代之后也没有这类结构虹桥的建造记录，不仅关于它的工程技术已经失传，甚至关于它的形象都深埋在历史中。1953 年《清明上河图》第一次对外公展时，桥梁学家唐寰澄先生才从画中发现这一中国古代工程奇迹。（其实木拱结构的“汴水虹桥”也反证了这是《清明上河图》张泽端真迹，因为其他摹本，比如明代仇英摹本的《清明上河图》里这个桥就是一座石拱桥）\"},{\"para\":\"\"},{\"para\":\"唐寰澄对虹桥结构的推测。\"},{\"para\":\"\"},{\"para\":\"唐寰澄以火柴棍示意汴水虹桥结构体系。\"},{\"para\":\"唐寰澄所做的研究，只是证明这种虹桥建造技术确实可行，但因为宋代灭亡后中原地区的虹桥绝迹，近代学者一直认为这种桥梁已经失传。直到 1980 年 10 月,《中国古桥技术史》编写组的专家在闽浙山区又找到了多例现存虹桥实物，这类桥才重新回到学界的视野。\"},{\"para\":\"\"},{\"para\":\"屏南万安桥\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"寿宁鸾峰桥\"},{\"para\":\"\"},{\"para\":\"屏南千乘桥和桥中央的神龛\"},{\"para\":\"上面只是简单列举一些例子，实际上福建虹桥的现存实例非常丰富，这也就是福建虹桥能够独立成为一个文化整体的潜力所在。想要成为一种“文化”，需要历史典籍的记载，传奇实例的渲染，和融入人们生活、数量足够多、形式足够丰富的实例，这几点，福建虹桥都具备了，所以我觉得这也是最接近题目中“桥文化”的系统了。\"},{\"para\":\"二、侗族风雨桥\"},{\"para\":\"另一个数量极为庞大，造型非常有特色，可以自成一系的桥种。\"},{\"para\":\"不像上文中的虹桥那样拥有世界独一份的木拱技艺，实际上侗族风雨桥的特点不在于特别先进的桥梁技术，而在于盖在桥梁上面可供人遮风避雨的亭台楼阁和回廊，“风雨”一词也因此得来。举几个例子。\"},{\"para\":\"\"},{\"para\":\"鼎鼎大名的程阳风雨桥，每跨石墩间运用的是叠梁式的木梁桥，因此程阳风雨桥按照分类来说应该是石墩木结构梁桥，也是最正统的侗族风雨桥。\"},{\"para\":\"\"},{\"para\":\"乾州古城风雨桥，这货按分类来说是石拱桥。\"},{\"para\":\"\"},{\"para\":\"2010 年修建的三江风雨桥，这是一个钢筋混凝土单桥拱，当然，因为上面盖了侗族风格的楼阁，你也没法说它不是风雨桥……\"},{\"para\":\"看到这里大家应该有概念了，侗族风雨桥发展到现在，跟桥梁本身建造方式的关系已经不大，夸张一点说，在南京长江大桥上加个侗族的顶，甚至可以叫南京长江大风雨桥。\"},{\"para\":\"虽说有些形式主义，不过侗族风雨桥和侗寨结合，倒已经是一个独特的文化体系。可惜的是，侗族本身没有文字，历史上风雨桥的渊源就没有详尽的史料记载，也就无法找到比如《清明上河图》的汴水虹桥这类传奇祖先；又因为桥本身极易损坏的属性，现存最早的风雨桥建造年代实际也并不是很久远，比如风雨桥的代表程阳风雨桥修建年代是 1912 年。\"},{\"para\":\"\"},{\"para\":\"不过无论如何，侗族风雨桥凭借庞大的数量和侗族美妙的建筑样式，继续演化为一个有深厚底蕴的“桥文化”还是潜力巨大的。\"},{\"para\":\"三、江南水乡和“桥”\"},{\"para\":\"我觉得桥独立出一种文化很困难，是因为桥本身作为构造物很难成为一种独立的“偶像”，也很难成为区域景观的核心；而即使通过巨大体量成为景观核心（比如旧金山的金门大桥、伦敦桥），因为是独立的单体，也很难说能够形成一种自成体系的“文化”。\"},{\"para\":\"这一个段落也是如此。江南水乡确实有数不清的桥，桥、河道、船只、古镇和相关的诗词歌赋也确实组成了一种独立的景观和文化体系。但是如果把桥单独拎出来造一种文化，就牵强很多，毕竟水乡是一个整体，少了哪一种元素都不再完整了。不过，因为水乡美感确实独特，还是有展示的价值的，权当抛砖引玉吧。\"},{\"para\":\"\"},{\"para\":\"普济桥\"},{\"para\":\"\"},{\"para\":\"众安桥\"},{\"para\":\"\"},{\"para\":\"思范桥\"},{\"para\":\"\"},{\"para\":\"通贵桥\"},{\"para\":\"\"},{\"para\":\"吴门桥\"},{\"para\":\"我觉得上面的图片能够给大家一个感觉：水乡是一个整体。图中的桥说实话无论从体量、技术、美学层面上来说，都算不上多么优秀，但是和周围环境结合之后，却能够形成一种不输任何精美桥梁的美感。\"},{\"para\":\"四、魔幻现代城市重庆的桥\"},{\"para\":\"其实我们思考文化，并不需要局限在“历史”中。这几年风靡世界的美漫超级英雄，其实作为文化来说，已经胜过大多数的历史传统文化，当然我所谓的胜过，是从互联网“点击数”，媒体报道数，娱乐性，话题性上来衡量的。现在的世界是一个“流量”的世界，通过话题性引导流量，塑造新的“文化”，也许是另一条路子。\"},{\"para\":\"我觉得有潜力通过现代城市景观塑造的“桥文化”，是重庆的桥。\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"重庆其实最近一两年在互联网上已经引起很多次风潮了，“魔幻城市”之类的称号也开始多了起来。实际上，重庆所有的天桥、立交桥，并没有任何“文化”上的野心，大部分都是纯粹为了满足功能需要。但也正是因为这样单纯的原因，魔幻又具备了坚实的现实基础：这种奇幻的景观不是为了美观生造出来的！\"},{\"para\":\"而我认为重庆的潜力就在于此。到目前为止，重庆引起的风潮似乎没有经过任何机构有意的引导，只是一些游客偶然路过，被折服后自发的传播行为，而能够成功传播，也证明这种景观在互联网上也有广泛的传播基础，这说明现代游客已经不再只认为旅游的目的地是“历史文化或遗迹”，而已经懂得发掘城市本身潜藏的美了。另外，因为重庆的城市景观并没有刻意追求任何“魔幻”的元素，因此一旦城市规划者开始有这方面的主动意识，也许能够利用现有条件，创造很多新的旅游元素出来。如果能做到这一点，属于现代重庆的“桥文化”也许就真得可以开花结果。\"},{\"para\":\"以上是我觉得有潜力成为“桥文化”的几个例子，我相信在这么一堆东西之后，看客们应该也知道我所谓“潜力”是什么意思了。\"},{\"para\":\"先写到这里，灵感来了再继续更新这个回答罢。\"},{\"para\":\"更多讨论，查看 知乎圆桌 · 寰行中国桥文化之旅\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"要是一个儿童说出了「被性侵的过程」，我们该相信他吗？\",\"content\":[{\"para\":\"从法律的角度来说，儿童的性侵描述是可以作为证词的，关键是是否可信。所以我想说说在为此类儿童录口供时的具体做法，以香港为例。\"},{\"para\":\"儿童对这种创伤性体验的描述，可能会有各种因素导致它失真。除了其他知友所说的种种心理因素，还有很多社会因素会影响儿童的描述。因为性侵儿童案件的施害者很多是儿童的熟人甚至家人，施害者往往会对儿童进行哄骗、诱惑甚至威胁，这种复杂的关系会令儿童对性侵的性质产生困惑，儿童也有可能出于对施害者的感情，或被威胁的恐惧而不敢说出实情。儿童的描述既有可能夸大或错误，也有可能为施害者掩饰而隐瞒，所以不一定能作为可靠证据采信。\"},{\"para\":\"香港对被性侵害的儿童录口供的方式，可以说是在考虑儿童的权利、感受和心理状况的基础上，尽可能提高口供的可靠性的很好的做法，非常值得借鉴。\"},{\"para\":\"在处理此类个案时，为了搜集证据，以及避免有关儿童向不同人士重复指控细节而对其造成更大的创伤，香港警方及社会福利署会成立“保护儿童特别调查组”，联手调查。调查中最高原则是“保护儿童”，也就是说，儿童的利益高于抓罪犯、父母的权利等。调查过程中尽量减少儿童描述经历的次数，最理想的情况是只描述一次，因此如无必要，通常只在为录口供而做的面谈时询问儿童。\"},{\"para\":\"1.初步商讨及制定策略\"},{\"para\":\"调查组要在接案后 24 小时内召开制定策略会议，与负责部门的社工及其它有关专业人士（医生、心理学家、老师等）制定联合调查计划：在保证儿童安全的前提下，制定调查范围，决定是否要与儿童面谈及最恰当的时间和方式。如果儿童与疑犯同住，一般会安排疑犯或儿童离家，除了避免后续伤害，也是为了避免疑犯影响儿童的证词。\"},{\"para\":\"2. 调查会面\"},{\"para\":\"通常应尽快安排会面，为了尽量减轻儿童所承受的压力，降低儿童忘记相关细节或受他人影响的可能性。会面前应考虑儿童的身心状况、儿童对面谈人员的了解及信任、根据儿童的年龄准备合适的语言等。\"},{\"para\":\"香港法律规定，就性及暴力罪行与儿童证人会面的录影记录可作为证据。录影会面必须在特别为顾及儿童感受而设计的家居录影室内进行，只有在证人无法前往家居录影室时才可在医院内等合适的地点录影。\"},{\"para\":\"录影时只应由受过联合调查及录影会面训练的警务人员、社署社工及心理学家与儿童会面，会面人员应懂得有效与儿童沟通，包括儿童受困扰时的沟通。会面时如儿童拒绝说话，调查组可决定暂停调查，并在有需要时转介儿童接受临床心理学家评估和治疗。\"},{\"para\":\"3. 审讯前准备及治疗\"},{\"para\":\"在录影会面后到法庭审讯之前，调查组会继续与儿童及其家庭保持联络，让他们知道调查进展，同时帮助儿童做好出庭作证的准备，比如去法庭参观、熟悉法庭的环境、审讯的程序等。如经评估儿童的身心状况及意愿后认为不适宜出庭作证，可用视频直播等形式出庭，同时也接纳符合审讯程序的影像记录作为主问证据。\"},{\"para\":\"完成录影面谈后，社署会为受害人安排适当的心理辅导及治疗。在审讯前，心理辅导及治疗时应避免提及调查面谈的详情、性侵事件的细节，不可使用任何资料暗示或假设发生过性侵事件。审讯前的辅导与治疗的录影或过程书面记录有可能会被提取成为法庭证据，因此很多心理临床工作者考虑到儿童对此的顾忌，会选择不录影，相关记录会按照保密原则小心保管。\"},{\"para\":\"以上就是香港对被性侵儿童录口供的做法。我看到有知友的回答中说到对被性侵儿童录口供中的困难，这是很正常的，对经历过性侵的儿童进行询问需要很多特别的技巧，不同年龄段的儿童又需要不一样的谈话技巧，没有经过针对性训练的人是很难做到有效沟通的。所以在香港，此类案件中录口供的警务人员都是经过训练的，不同的案件会经过评估后指定适合的人去询问。同时影像会面时通常不允许家长进入录影室，因为有时候家长的情绪表现会对儿童产生心理暗示，会影响儿童证词的可信度。如果孩子的情绪非常不稳定需要熟悉的人陪同，那么一般会由一名孩子熟悉的专业人士陪同，比如学校社工、主治医生等，陪同人士会经过提前沟通了解面谈中应该及不应做什么。一般情况下家长可以在观察室观看面谈过程，如果儿童不愿意或者经评估认为家长观察也会影响儿童的表达，那么家长连观察都不可以。\"},{\"para\":\"另外，我在学习游戏治疗过程中，多位老师和督导都曾说过，在一些受害者是很年幼的孩子的案件中，因为孩子的语言发展不足以准确描述事件，警方会请游戏治疗师以游戏的方式与孩子沟通，游戏治疗师的解读和分析是可以作为法庭证据的。比如某位老师曾经做过一个两岁女童被性侵的案件的证人，在没有引导的情况下，这个孩子用两个人偶做出了性交的动作，这算是一种佐证吧。\"},{\"para\":\"恩，我从法律的角度说一下吧。\"},{\"para\":\"法律关于证据的规定是很严谨了，因为法律事实就是靠证据说话，不然法官如何认定事实部分呢？\"},{\"para\":\" 首先，关于 14 岁以下儿童的性侵犯证词是可以作为证据的。\"},{\"para\":\"刑事诉讼法律的规定的种类有如下七种：（一）物证、书证；（二）证人证言；（三）被害人陈述；（四）犯罪嫌疑人、被告人供述和辩解；（五）鉴定结论；（六）勘验、检查笔录；（七）视听资料。\"},{\"para\":\"如果儿童属于第二种，那就要看当时的儿童作证时候的心理状态了，刑事法律认为儿童和精神有缺陷的人是可以作证的，因为只要能够辨别是非和分清客观事实就可以了，不能一概视为不能作证的人群。这一点应该由公安机关，检察院在案子进行调查的时候自行决定，最后进入法院审理的时候由法官决定。\"},{\"para\":\"按照题主的问题，应该属于第三种。这种比较特别，因为受害人具有特殊性和唯一性。一个案件只要能够进行被害人陈述就可以作为案件的认定证据，如何认定未成年人关于性侵犯是否能进行陈述呢？这一点的基本原则应该和上面那一条没啥区别。\"},{\"para\":\"第二，进行刑事定罪，仅仅有儿童性侵犯的证词是不够的。\"},{\"para\":\"刑事法律事实的认定是十分严格的，且不说每种证据都有自己的认定标准，而且要求各种的证据要形成完整和基本的证据链。法庭质证阶段也是十分严格的，进行非法证据的排除，最后能够定罪的证据必须十分确定。换句话说，只要上述的几大种类证据能够形成完整的证据链就可以定罪，儿童的证词不不会起到决定性的影响，这也是刑事诉讼法一直贯彻的基本原则。\"},{\"para\":\"总之，儿童的性侵犯的证词或者受害人陈述，只要符合上面证据的认定标准是可以作为证据进行采纳的。就算没有进行采纳，只要有其他证据的存在也是不妨碍法院最后对被告人定罪的。\"},{\"para\":\"更多讨论，查看知乎圆桌 · 向儿童性侵「说不」\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"号称敷了一次就能让人变白的面膜，是不是有毒？\",\"content\":[{\"para\":\"生活中我们都或多或少听过“荧光增白剂”，知道把他加进去东西就会变白，而且人们每当提到“荧光增白剂”都会谈之色变，鄙夷不屑。那么这篇文章我就尽量用简洁易懂的语言，为大家揭开\\\"荧光增白剂”的面纱。\"},{\"para\":\"荧光增白剂并不是白色的，而是一种无色染料，他的增白原理是：吸收阳光中的紫外线（波长在 300~400nm），使分子中电子激发，再回到基态时，紫外线能量便消失一部分，转化成能量较低的蓝紫色可见光反射出来（波长 420~500nm）。\"},{\"para\":\" 抵消了织物上因反射光中黄光过多而造成的黄色感，与织物上反射出的偏重的黄光混合为白光，织物不仅白度增加，而且增加反射率，使得织物的亮度提高，比一般漂白织物更加悦目，对浅色织物有增艳作用。\"},{\"para\":\"\"},{\"para\":\"（在紫外线照射下荧光增白剂溶液发出蓝紫色光）\"},{\"para\":\"专业知识解答有难度可略过\"},{\"para\":\"\"},{\"para\":\"通常情况下，分子中电子排布在 n 轨道以下的轨道上，这种状态称基态。分子吸收光子后，基态的一个电子被激发到反键分子轨道（电子激发态），称为电子跃迁。分子中相邻的电子能级的能量差约为 1~20eV，这样的能量与紫外线和可见光的能量相当。因此，产生电子跃迁的必要条件是物质必须接受紫外光或可见光的照射，只有当照射光的能量与价电子的跃迁能相等时，光才能被吸收。\"},{\"para\":\"\"},{\"para\":\"常见荧光增白剂 VBL 结构式\"},{\"para\":\"我们可以看见结构含有大量苯环，共轭双键(发色基团）及—NR2（助色基团，促进紫外线吸收基团）。\"},{\"para\":\"荧光增白剂有许多不同的种类，有适合染棉麻的，有适合染化纤的，有适合染羊毛蚕丝的等等。这也导致了不同的荧光增白剂有不同的性质。\"},{\"para\":\"举个例子：\"},{\"para\":\"荧光增白剂 VBL：对棉纤维亲和力高，耐光牢度较好，但耐氯牢度较差。（用含氯消毒液很容易使其结构破坏，脱落，衣物颜色泛黄）\"},{\"para\":\"荧光增白剂 DT：不溶于水，商品要被制成乳液形式才能染色。（不易水洗脱落）\"},{\"para\":\"部分荧光增白剂有可能随着衣服洗涤，牢度降低，附着在人体皮肤上。\"},{\"para\":\"甚至有不法商家，为了提高面膜美白效果，号称贴一次就见效而添加过量荧光增白剂在面膜中。\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"荧光增白剂对人体健康影响：\"},{\"para\":\"毒性试验记录表格\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"[1]\"},{\"para\":\"总结：\"},{\"para\":\"[1]董仲生. 荧光增白剂的实用性和经济性及其对人与环境的影响[J]. 中国洗涤用品工业,2011,(05):25-35. [2017-08-26].\"},{\"para\":\"DOI：10.16054/j.cnki.cci.2011.05.011\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"一幅开车细节惊人的大师作品，亮点和槽点简直数不完\",\"content\":[{\"para\":\"第一次在 wiki 上看到油画原图去到 220 MB，可想而知这细节多惊人了，不放大不能发现那么多开车的成分啊——一幅惊艳和问号了 500 年的三联画《人间乐园》——来自耶罗尼米斯 · 博斯（Hieronymus Bosch，1452 年－1516 年 8 月）荷兰画家，超现实主义的穿越鼻祖。\"},{\"para\":\"他一生幸福美满，却心存不为人知的各种癖。\"},{\"para\":\"所以这幅画亮点和槽点足够让审美密集恐惧主义者高潮迭起。\"},{\"para\":\"\"},{\"para\":\"The Garden of Earthly Delights\"},{\"para\":\"Museo del Prado in Madrid\"},{\"para\":\"c. 1495–1505\"},{\"para\":\"所以，为免出事，我们把天堂 - 人间 - 炼狱分解来慢慢看？\"},{\"para\":\"1 、此画作于 1500 年左右，世纪末来临总有人惊叹人类要灭亡，艺术家总是倾向末日狂欢的，参看 1890 年代的巴黎。\"},{\"para\":\"2、哥伦布 1492 年发现了新大陆，带来了奇怪的物种——例如草莓，也带来了新大陆上的异闻——野蛮男女、奇怪景观等。\"},{\"para\":\"3、博斯在 13 岁时目睹了一场烧毁了 4000 座房子的可怕火灾，所以酷刑火灾什么的，到底是画家的癖好还是阴影？\"},{\"para\":\"我们从简单安静的配色，如梦又异空的景观开始。\"},{\"para\":\"\"},{\"para\":\"相对正常的动物\"},{\"para\":\"长颈鹿有点怪是因为欧洲没有长颈鹿，画家是照着考古书画的。\"},{\"para\":\"独角兽的出现证明了天堂纯洁。\"},{\"para\":\"但这只开始看书的、象征异端的鱼身鸭嘴兽，似乎已准备坠入暗黑的深渊。\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"调皮的人面建筑\"},{\"para\":\"喷泉狡黠的微笑，深藏功与名——以及中间洞悉人心的猫头鹰\"},{\"para\":\"岩石上的眼睛和胡子是已经脏脏的各种爬虫，让人想起达利，头顶一丝乱发是引诱夏娃的那条蛇，而变成山洞而不翼而飞的耳朵？后面大家会看到。\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"颜色还是延续天堂的样子，但画面以及白花花的肉体则紧凑了许多。\"},{\"para\":\"欲求的水果\"},{\"para\":\"鲜美却容易腐烂的草莓以及其他浆果，刚刚从新大陆传入欧洲，它成为人们欲求的对象，有时成为保护的外壳，有时又成为痛苦的根源，直到吞噬了人的本体。\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"怪兽 play\"},{\"para\":\"动物的比例失实后，让你的沉浸感大增。\"},{\"para\":\"再加上它们边卖萌边开始做羞羞的事情。\"},{\"para\":\"人和野兽的界限到底在哪里？\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"盲目聚众的人类\"},{\"para\":\"除了一部分能飞起来的人，更多人只是蜂拥而上、没有辨识度 ，害怕落单。\"},{\"para\":\"为了追逐欲望，被一时甜头吞噬，再看不到其他。\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"到处都是不可描述的 CP 行为，各种跃跃欲试的体位。\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"有几风流就有几折堕。\"},{\"para\":\"突然天昏地暗，我们随着博斯记忆中的大火开始炼狱之旅。\"},{\"para\":\"\"},{\"para\":\"十大酷刑与七重罪\"},{\"para\":\"最舒服的刑罚的已是被吃掉，然后被排出来。\"},{\"para\":\"或者可选择被母猪亲吻。\"},{\"para\":\"一个小挑战：整幅炼狱的画里能找齐七重罪，答案见百度。\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"我们在这里找到了天堂的耳朵君，只是它已惨遭一把名为Ω（希腊字母表最后一个字母，象征终结）的刀迫害。\"},{\"para\":\"\"},{\"para\":\"乐器奏出的各种衍生内容\"},{\"para\":\"然而，假使耳朵还能听到，下面的这些器乐会发出什么声音？它们看上去更像刑具。\"},{\"para\":\"因为在博斯心中，音乐是纵欲的象征，不应该掩盖上帝之声——而直到巴赫的时代，教会也认为宗教音乐是单纯的，巴赫华丽的旋律和配乐就经常被批评。\"},{\"para\":\"从左到右看：\"},{\"para\":\"鲁特琴变成了火刑柱；\"},{\"para\":\"竖琴上钉着被琴声诱惑的人；\"},{\"para\":\"巨大的绞弦琴像是绞刑架，上面的刽子手边演奏，竟然还边被另一个人虐；\"},{\"para\":\"（这乐器就很中世纪和中二啊，忍不住先插一视频为下面内容热身，请不要看演奏者表情）\"},{\"para\":\"【中世纪！电音！】【HurdyGurdy】奇葩的乐器我们奇葩地弹 Break Your Crank\"},{\"para\":\"一个正在被绞死的人手里提着三角铁；\"},{\"para\":\"敲打着大鼓的恶魔嘲讽着被关在鼓里的可怜虫；\"},{\"para\":\"喇叭变成了烤炉；\"},{\"para\":\"刚提到右下角猪强吻的声音，作为伴奏应该还蛮大声的。\"},{\"para\":\"\"},{\"para\":\"一个来自牛津大学的团队成功地还原了里面全部的古乐器。但是这些严格按照画家描绘被精确复原的古乐器却让团队大失所望，发出的声音不仅不优美，反倒十分刺耳。那就对了，里面的人不就是捂着耳朵不想听到这些可怕的声音吗？\"},{\"para\":\"然而，上图纹在屁股上的乐谱2015 年被名为 Amelia Hamrick 的牛人演绎出来，并取名为：The 500-Year-Old Butt Song from Hell。\"},{\"para\":\"戳这里听歌：\"},{\"para\":\"The 500-Year-Old Butt Song from Hell\"},{\"para\":\"带着这股风味，我们顺便来看看一个重要的槽点——屁股。\"},{\"para\":\"屁股用处非常大，除了可以纹乐谱它可以用作其他容器用途。\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"\"},{\"para\":\"博斯现身说法\"},{\"para\":\"这也难怪后世对他癖好的猜测了。博斯很淡定，他在画面正中，转头回应你一个意味深长的笑容。\"},{\"para\":\"\"},{\"para\":\"他的身体变成了蛋壳，后庭敞开，里面是他心中地狱里唯一的明灯——哲学♂小组？\"},{\"para\":\"幻化为树人的他，脚踩“愚人船”——当时用作驱赶精神病人的做法，也是博斯另一幅作品的取材。\"},{\"para\":\"还有更多来自尼德兰的俚语与箴言的荒诞表现。这些都可以在博斯的同乡——我很喜欢的布鲁盖尔的画中看到。\"},{\"para\":\"\"},{\"para\":\"最后，三件画作合起时，则变成了上帝创造地球的灰色装饰画——创世纪之初，可能是第三日，植物被创造之后，动物和人类被创造之前。\"},{\"para\":\"运用同样的套路，博斯还有其他的三联画作品。即使不深究，或者说，不深究的话，也是眼睛的甜品。\"},{\"para\":\"\"},{\"para\":\"The Haywain Triptych, 1510–16. Prado, Madrid\"},{\"para\":\"\"},{\"para\":\"The Last Judgement，Academy of Fine Arts Vienna\"},{\"para\":\"所有的这些荒诞、欢愉、锯齿、透明、倒立、吞噬，是否还想再走近一点？\"},{\"para\":\"如果暂时去不了或者错过了普拉多美术馆，Wiki 英文版提供 220M 巨清大图玩赏。\"},{\"para\":\"更爽的是，Google Cardboard 还出了这幅画的体验 VR ，你还把持得住吗？\"},{\"para\":\"Onedaystand 的我：把持不住了，求出体感 game~\"},{\"para\":\"更为细节控的周边——大图请入：\"},{\"para\":\"Bosch｜从天堂到地狱，咬着草莓，开始奇怪的周末狂欢\"},{\"para\":\"\"},{\"para\":\"欢迎关注微信公众号：Onedaystand\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"特别版瞎扯 · 你看，我们又要过七夕了\",\"content\":[{\"para\":\"大家好，这里是「特别版瞎扯」，除了内容特别长之外，更是一个笑点与泪点齐飞、甚至会有点扎心的「瞎扯」。\"},{\"para\":\"今天是七夕节，第二期的「特别版瞎扯」献给所有「爱人们」。\"},{\"para\":\"——爱你的知乎日报团队\"},{\"para\":\"有人问我什么是爱情。这真的很难回答，我说， 我跟你讲一个物理实验吧(大概是光栅衍射记不清了，大学物理实验）,我看到的，两束光在重叠一起的时候，发生了颤栗。我用这个比喻爱情。可能你没见过，如果你见过会一生难忘。所以有时我想，灵魂是一束光。\"},{\"para\":\"这个实验我看的时候，绝对震撼了。当然震撼的只有我自己，因为我联想到这就是爱情。\"},{\"para\":\"有一次晚上在街上散步\"},{\"para\":\"买了一包栗子边走边吃边闲聊，我连续剥了三个给她她都直接放到嘴里，第四个故意没剥给她她又放嘴里还很认真的嚼了两下，当时我都笑得快岔气了，她当然是追着我打。\"},{\"para\":\"你们可以想象那画面吧，霓虹灯五光十色车特少的马路边上。\"},{\"para\":\"-\"},{\"para\":\"买了草莓，到了家我就去厨房择洗。\"},{\"para\":\"正洗着，她从身后抱住我，头倚在背上。\"},{\"para\":\"–「怎么了？」\"},{\"para\":\"–「没什么。」\"},{\"para\":\"然后我继续洗草莓，她继续倚着。\"},{\"para\":\"-\"},{\"para\":\"对异地恋来说，能牵手的时候都是最幸福的；对异国恋来说，能联系上的时候都是最幸福的。\"},{\"para\":\"不处于同一时区，才知道时间的珍贵\"},{\"para\":\"为无时差无距离的恋爱而奋斗！\"},{\"para\":\"他向别人很大方地介绍我是他女朋友的时候。\"},{\"para\":\"听喜欢的人说心里话。\"},{\"para\":\"醒来看见有未读的消息。\"},{\"para\":\"说着话散着步仿佛世界无尽头。\"},{\"para\":\"我们是大学同班同学 全班聚餐 酒过 N 巡之后 大家都貌似已然饱和\"},{\"para\":\"她室友兼闺蜜想要整我 灌我酒\"},{\"para\":\"纵然我已到达了酒量的极限 但是碍于面子（她是我班的班花，平时很文静 很淑女。基本没怎么说过话，路上遇见招呼都不带打的。我一直是只可远观不可亵玩）又不得不喝\"},{\"para\":\"我摊坐在椅子上百般拖延敷衍\"},{\"para\":\"只见坐我旁边的她\"},{\"para\":\"蓦地端起我面前满满的一杯酒\"},{\"para\":\"大声呵斥我：没用的家伙，以后别跟人吹你能喝\"},{\"para\":\"咕噜咕噜一口干掉\"},{\"para\":\"待我讶然惊醒，全场静默 5 秒后，起哄声就无法控制\"},{\"para\":\"然后 四目对视 满满的柔情\"},{\"para\":\"一个念头闪过 这就是我要的女人\"},{\"para\":\"高中的时候，他说，别的姑娘看我打篮球，我的余光在看她们，你在旁边看我打篮球的时候，我的余光只能看球了。\"},{\"para\":\"开始总是分分钟都妙不可言。\"},{\"para\":\"我希望迫切地了解她的一切，又怕过于细致的问询让她不胜其烦。\"},{\"para\":\"我希望能让她了解到我的想法，又怕暴露的迫切表情让她无所适从。\"},{\"para\":\"我希望她会跟我一样对彼此的感受好奇，又怕自己自作多情，毁了之前累积的一切。\"},{\"para\":\"我会偶然间憧憬一下与她一起旅行玩耍的日子，又怕冲淡了好不容易培育的萌芽。\"},{\"para\":\"我也会想是不是放弃才好，但爱情总是这么让人患得患失。\"},{\"para\":\"恋爱的初期是最美好的日子，因为恋爱之前你是一人，无人分享你的故事；恋爱后期彼此了解，做错事情彼此也不会介意。\"},{\"para\":\"你不再会患得患失，不再会对彼此的一切都非常新鲜，不再会因为她偶然间提到的一部电影而花上几个小时去看。\"},{\"para\":\"胡乱写两句，因为我也在迷茫中探索着开花的日子。祝好。\"},{\"para\":\"脱单的第二天刷牙照镜子时候看着自己时候呆住了\"},{\"para\":\"【这样就脱单了？】\"},{\"para\":\"然后忍不住就笑起来了呢。\"},{\"para\":\"真好呢。\"},{\"para\":\"-\"},{\"para\":\"=_=分手了。\"},{\"para\":\"他家有一片草原，任你飞驰，有几颗地雷，勿踩，分分钟让你粉身碎骨。\"},{\"para\":\"说出口的她都懂，说不出口的她都理解。\"},{\"para\":\"彼此相知，互相仰望。\"},{\"para\":\"丰富的过去，要能在你这里安定下来，总比一张白纸却不甘心，期待不安分的未来，要好。\"},{\"para\":\"大一开学第 114 天，我俩确定关系，我对她说我想永远就这样牵你的手，她脸红的点了下头。交往第 1255 天，我俩毕业，回到共同的城市。第 1826 天，我在一轮明月下向她求婚，我得到了“我愿意”。第 1950 天，父亲弥留之际我们仓促的把结婚证给领了，她喊了爸。当天晚上我到殡仪馆外和父亲隔着那一道墙，她一直默默的在我身边，那天离我俩的婚礼只剩 16 天。婚礼由于父亲的离世完全取消，那天我简单的开着车从她家里把她接到酒店，她安静的把手伸给我，把一生托付给我。\"},{\"para\":\"幸福就是这么简单，她给了我一生和她在一起的理由。\"},{\"para\":\"今天是我们的第 2028 天。\"},{\"para\":\"很多人不理解为什么要计算到天，因为我确实喜欢拿天计，无聊的时候也喜欢时不时的和老婆一起算今天是我们恋爱的第几天，这是我们的传统而已。\"},{\"para\":\"结婚前夜，姐问老爸：种了这么久的白菜被猪拱了是什么感觉？老爸淡定的说：白菜本来就要给猪吃的\"},{\"para\":\"我做好了你随时要走的准备，也做好了和你过一辈子的打算。\"},{\"para\":\"以为换着跟很多不一样的人在一起能够丰富人生，发现比不上跟一个真正有趣的人过一辈子。\"},{\"para\":\"有一个人我以为我忘了，但输入法还记得。\"},{\"para\":\"有些歌一直在电脑里 前奏响起手忙脚乱的去点下一首。\"},{\"para\":\"有些城市我这辈子都不想再去。\"},{\"para\":\"刚分手的时候觉得早他妈该分了，分得越久越觉得回忆翻滾痛不欲生，你以为你翅膀硬了可以飞，却不知道他才是你的翅膀，你没了翅膀，满身血，在地上乱爬，慢慢伤口结痂，长出属于自己的翅膀，却发现自己已经不想飞了，不想再去浏览这个世界的广阔，只想脚踏实地去行走。\"},{\"para\":\"开空调，抱一起，营造一种在北极那种艰苦卓绝，生死相依的感觉\"},{\"para\":\"和男友从第一次睡在一起就养成了一个我觉得超级棒的好习惯\"},{\"para\":\"睡前抱在一起聊天，倾诉的那个人躺在倾听的人怀里。\"},{\"para\":\"准备睡觉的时候!!!!\"},{\"para\":\"两人向相反方向咕噜，滚到可达到的最远距离，\"},{\"para\":\"他背对我，我面朝黄土背朝天，\"},{\"para\":\"有一种马上就分手、感情到尽头的感觉。\"},{\"para\":\"这才是男女朋友睡觉最舒服的姿势!!!\"},{\"para\":\"抱在一起不热吗？\"},{\"para\":\"压着胳膊不麻吗？\"},{\"para\":\"对方就在自己脸边耳边打呼不烦吗？\"},{\"para\":\"以前我跟她每回吵完架 就会玩一个游戏 就是两人互相扮演刚才吵架时候的双方 我说她的台词 她说我的台词 还得模仿语气再“吵”一遍\"},{\"para\":\"每次玩着玩着就会笑蠢\"},{\"para\":\"你能想象对方模仿你的语气说“你怎么不考虑我感受啊你怎么脾气这么差啊 你就不能体谅体谅我么…”然后还一边装哭 一边笑 cry\"},{\"para\":\"然后你就会觉得她说出来 TM 的实在太别扭了 你自己刚才怎么那么矫情\"},{\"para\":\"然后你就得学她反击回去\"},{\"para\":\"真的 只要试一次 一次你们就能发现 真的超好玩\"},{\"para\":\"有一回跟她在大街上吵架 吵完和好之后立刻玩这个游戏 因为台词都还新鲜出炉的 都记得 完全笑到走不动\"},{\"para\":\"当时觉得我们就俩神经病 情侣吵架必备游戏啊简直\"},{\"para\":\"【完全符合好玩。紧张。刺激。】\"},{\"para\":\"我和男朋友玩过一个“只有我可以做到你太弱了你不行”的游戏。\"},{\"para\":\"即在不牵扯对方没有的器官的情况下，做一件只有自己能做的事。如果对方做不到，就罚一杯酒。\"},{\"para\":\"然后…\"},{\"para\":\"我们这对半个月才能见一次的干柴烈火的热恋期情侣独处一室，分别向对方表演了：\"},{\"para\":\"吞拳头、肚子上的肥肉夹戒指、戒指藏进肚脐眼、大拇指第三个关节无外力情况下自己弯曲、中指上的筋无外力情况下自己弹动…\"},{\"para\":\"以及\"},{\"para\":\"双盘腿、大拇指弯到手掌后面、脚放到头后面、酒窝夹戒指\"},{\"para\":\"等等精彩纷呈的民间才艺\"},{\"para\":\"\"},{\"para\":\"结对编程。\"},{\"para\":\"本期「七夕节」主题的「特别版瞎扯」到此就结束啦，朋友们，再见~\"},{\"para\":\"\"},{\"para\":\" \"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"负能量爆棚无心工作，怎么过了一个周末你还是这么累？\",\"content\":[{\"para\":\"文章来自机构帐号：KnowYourself\"},{\"para\":\"来看看你是否遭遇了以下这些状况：\"},{\"para\":\"1. 在工作日仿佛是被上紧了发条的钟表马不停蹄，但一到周末就浑身乏力，懒得动弹；\"},{\"para\":\"2. 常常感觉全身酸痛，尤其是肩颈、腰、臀、背等部位；\"},{\"para\":\"3. 很容易就出现腹泻等肠胃不适的状况，或者频繁感冒；\"},{\"para\":\"4. 性欲明显下降，无论是面对伴侣还是其他可能引起快感的刺激，内心（身体）都“毫无波澜”；\"},{\"para\":\"5. 莫名变得特别喜欢吃甜食及各种高热量的食物；\"},{\"para\":\"6. 习惯性拖延，不论是工作还是生活上的事务，都总要是拖到“死线”（deadline）来临前才着手处理；\"},{\"para\":\"7. 与他人相处时总是带有攻击性，敏感，很容易就把他人一句再平常不过的言辞当做是对自己的责难；\"},{\"para\":\"8. 心里感到很矛盾，一方面渴望独处，对周围人感到不耐烦；另一方面渴望被陪伴与倾听，希望得到他人的理解与支持\"},{\"para\":\"9. 情绪波动很大，时常会莫名地大发雷霆；\"},{\"para\":\"10. “负能量”爆棚，整个人很消极，也总忍不住以负面的态度思考一切\"},{\"para\":\"如果你觉得自己最近，甚至是在比较长的一段时间内出现了上述多种状况的话，你需要警惕，这说明你的压力状况已经值得担忧了(Prevention, 2015; Segal, Smith, Segal, & Robinson, 2017)。\"},{\"para\":\"但并不是所有的压力都会给人带来严重的负面影响，也并不是所有人在遇到类似的压力情境时，都会受到同样程度的打击。那么，为什么有些人更容易受到压力的负面影响呢？\"},{\"para\":\"这其实主要与每个人应对压力的方式有关。换言之，在“压力”及“其对一个人所造成的影响”之间，有一个十分重要的中间变量——这个人应对压力的模式。\"},{\"para\":\"\"},{\"para\":\"四种应对压力的模式\"},{\"para\":\"压力的存在，从来都不是单纯负面的。事实上，它是每个人都必须要有的，对存活有着重要的意义。\"},{\"para\":\"人在受到威胁或刺激时，身体的交感神经系统会被激活，并开始释放大量的压力荷尔蒙。这会使得整个身体处于应激的状态之下，此时，人的心跳会加速，肌肉会变得紧绷，血压上升，呼吸变得急促，感官变得敏锐（Segal, et al., 2017）。\"},{\"para\":\"这种对压力的应激反应使得人的注意力与精力得以集中，加快了人的做出响应的速度，在弱肉强食的时代，为自己的寻得一线生机（Stress Stop, n.d.）。这也被认为，是人类能够在大自然的丛林法则下存活、繁衍下来的重要原因。\"},{\"para\":\"一直以来，社会大众与研究者们都认为，人们在压力状态下会做出“战或逃”（fight or flight）的选择，或者投入战斗，或者转身逃跑。近年来逐渐有研究者指出，除了“战或逃”，人们还会出现两种反应——僵死或服从（freeze or fawn）（as cited in, Heaney, 2017）。\"},{\"para\":\"在僵死或服从（freeze or fawn）的状态下，与战或逃时的反应不同。此时，血压下降，行动与声音都被抑制，看上去可能如同昏死一般（Schmidt, Richey, Zvolensky, & Maner, 2008）像在表示投降和服从，一方面人们可能因此逃过一些只对“活物”感兴趣的猎食者的捕杀，另一方面当人处于这种僵死的状态时，也有助于减少可能的失血量和痛苦感（Stress Stop, n.d.）。\"},{\"para\":\"在现代社会，这四种人体的神经应激反应被一直沿袭下来，成为人们应对压力的主要模式（Reisinger, as cited in, 2017; Spiritual Self Help, 2017; Stress Stop, n.d.）。\"},{\"para\":\"1. 战斗（Fight）\"},{\"para\":\"在面对压力时，一些人会进入战斗模式，比如，当一个人在遇到棘手的新项目时，Ta 会不分昼夜地加班加点，一丝不苟地完成任务，拼尽全力地达成目标（Spiritual Self Help, 2017）。“战斗”的应对模式，能够帮助人们化压力为动力，最终战胜困难，获得自己想要的结果。\"},{\"para\":\"2. 逃跑（Flight）\"},{\"para\":\"人们也可能在面对压力时选择放弃或逃离（Spiritual Self Help, 2017），比如，当一个新的职位充满了挑战和困难时，有些人就可能会主动选择放弃这个升职的机会。尽管很多人总把放弃或逃离看的很负面，认为这是意志力不足、不求上进或懒惰的象征，但其实有时候，“逃”能让人避免在压力面前过度坚持而屡屡受挫。\"},{\"para\":\"3. “僵死”（Freeze）\"},{\"para\":\"当发现眼前的困难过于强大时，儿时的我们可能会哭到昏睡，出现所谓的“断片”，这就是我们在以僵死的模式应对压力（Heaney, 2017）。成年后，这种“僵死”的应对模式则更多表现为一种“疲乏感”或者嗜睡，比如，有些人会在压力来临且尚未做出行动前，就感到疲惫。\"},{\"para\":\"不过，这种疲乏并不是一种逃避——它不是一个人主动做出的，而是被动感受到的。这种僵死的应对机制，“能让人们感觉自己在压力的情境中‘消失’了，就仿佛痛苦也随之消失了一般”（Seltzer,2015）。\"},{\"para\":\"4. 服从（Fawn）\"},{\"para\":\"人们在应对日常压力时，还会表现出对压力源的“服从”，即向给自己带来压力的事或人妥协、尊崇或讨好的安排。这在一些情况中，能够帮助人们趋利避害，更好地达成目标。\"},{\"para\":\"现实生活中，压力的来源可能是复杂多样的，这就意味着，每个人需要根据具体的情境，灵活地运用不同模式来应对压力，才有可能最大限度地减低压力给自己带来的负面影响（Walker, n.d.）。\"},{\"para\":\"也就是说，当有希望战胜压力时，Ta 需要全力以赴，为实现目标而争取（战）；当坚持可能带来更大的伤害时，Ta 要能果断选择放弃（逃）；当压力过大时，可以多给自己一些时间休息（僵死）；当自己感到不知所措时，Ta 也需要和压力源交流沟通，更好的了解压力源（服从）。\"},{\"para\":\"但如果，一个人总是单一地使用某一种模式去应对生活中出现的所有压力，那么 Ta 就很可能会为压力所困。下面我们会结合家庭教养类型，更具体介绍单一应对模式会带来的问题。\"},{\"para\":\"\"},{\"para\":\"家庭教养模式影响我们应对压力的模式\"},{\"para\":\"心理学家们认为，有些人之所以在成年之后总是以某一种固定的模式应对压力，与他们所受到的家庭教养方式有关（Seltzer, 2015; Spiritual Self Help, 2017）。1965 年，美国临床心理学家戴安娜·鲍姆林德提出了衡量家庭教养方式（parenting styles）的两个维度（as cited in, Locke,Campbell, & Kavanagh, 2012）：\"},{\"para\":\"根据这两个维度，父母对孩子的家庭教养的方式可以被分为：“低回应高要求”，“高回应低要求”，“低回应低要求”，以及“高回应高要求”。\"},{\"para\":\"1. 低回应高要求：“虎妈狼爸”与不停战斗的孩子\"},{\"para\":\"在这种家庭教育中，父母对孩子的要求很高，他们希望孩子是完美的、优秀的，同时他们对孩子的回应又是有限的、有条件的，孩子需要通过不断努力达到完美，才能获得家长的关心和爱。这使得这些孩子习惯于用“战斗”的方式获得自己想要的结果，包括试图战胜一切压力。\"},{\"para\":\"然而，这却容易让他们凡事都过度坚持，甚至有些完美主义（不仅追求完美，同时无法容忍缺憾）。这可能会使他们无时无刻都处于战备状态，始终无法放松地投入生活，这不仅可能引发焦虑，免疫、消化、心血管等疾病，甚至可能改变大脑的功能结构，进而影响个体的记忆、逻辑、决策的能力（均与过高的皮质醇水平有关）（Bergland, 2014）。\"},{\"para\":\"2. 高回应低要求：“割草机父母”与总是逃避的孩子\"},{\"para\":\"“割草机父母”指的是那些为了孩子的成功，随时赶在孩子前面将“杂草”清除，为孩子摆平成长道路上的一切困难的家长。这些父母对孩子的要求百依百顺，但却缺乏对他们的基本规训（discipline），以至于这些孩子一遇到困难就想逃避，希望得到父母保护，无法独立承担责任。\"},{\"para\":\"事实上，不断逃避并不会让这些人免受压力的伤害。当他们习惯于逃的时候，任何一点点困难都有可能引发他们的压力反应（交感神经系统的激活）。与不停战斗的孩子相似，他们也会因此受到过高的皮质醇水平所带来的负面影响。不仅如此，习惯性逃避还可能让他们更容易感觉到自己“一事无成”、进而产生消极的挫败和无望感。\"},{\"para\":\"3. 低回应低要求：“缺位的父母”与“消失”的孩子\"},{\"para\":\"这些父母既不关心孩子的需求，也不对孩子有所寄望。长久以来，这种关爱的缺失让这些孩子觉得自己唯有“消失”，才能感受不到被忽视的痛苦。因此，他们习惯于隐匿于人群之中，既不敢表现自己、为自己争取，也不懂得逃离、避免伤害（Spiritual Self Help, 2017），他们仿佛被“卡”在压力或痛苦的情境之中，直到精疲力竭。\"},{\"para\":\"而一味地以“消失”来回避压力带自己的痛苦，很有可能会让人长期缺乏对自身感受的觉察，使人陷入长久的空虚，甚至连自己的内在的需求与愿望都有可能逐渐僵死或丧失，他们总觉得自己疲惫不堪、紧张忧虑，却不知道这种感受缘何而来。这则有可能引发惊恐发作、强迫行为等（Seltzer, 2015）。\"},{\"para\":\"4. 高回应高要求：“直升机父母”与“服从”的孩子\"},{\"para\":\"直升机父母，通常会把孩子当做一切生活的重心，在将孩子的需求摆在至高无上的地位的同时，也对孩子有着不切实际的高要求。这些父母尤其在意孩子所取得的成就和在公开场合的表现，因而也会过度卷入孩子的生活，试图在各个方面施以控制、监视。这便会让孩子对父母“惟命是从”。\"},{\"para\":\"这些人习惯于服从，不惜牺牲自己的利益与边界去迎合他人。他们无法发展出健康稳定的自我感，他们的行为往往并非从自身需求出发，而是基于对他人感受的揣测而做出，这可能让他们在关系中无法拒绝别人，过度付出，最终不堪重负。\"},{\"para\":\"那么，如果你发现自己正受困于某一种模式之中，但又想要尽可能地摆脱压力给你带来的负面影响，应该怎么办呢？\"},{\"para\":\"如何更好地应对压力？\"},{\"para\":\"首先，你需要意识到，人们可以选择在不同的压力情境中，以不同的模式应对压力。尤其是，很多成年人都遗忘了自己在面对压力时，还有一种选择——“暂时停下脚步（freeze），去休息、调整”。\"},{\"para\":\"其次，你可以尝试去理解自己为何会受困于某一种应对模式，它可能带给你怎样的影响，并且试着主动去做出调整，比如，当再次面对不可企及的目标（unattainable goals）时，不妨知难而退，或者当再次遇到充满挑战的机会时，不妨试着迎难而上。\"},{\"para\":\"此外，一个人在多大程度上受到压力的负面影响，不仅与 Ta 应对压力的模式有关，还与 Ta 的一些生活方式和习惯有关。日常生活中的一些小方法也能帮助人们应对压力：\"},{\"para\":\"1. 保持每天 30 分钟的运动\"},{\"para\":\"研究发现，一定量的运动不仅能够刺激内啡肽的释放，还能对交感神经系统（压力荷尔蒙的释放）有一定的抑制作用。（Parker-Pope, n.d.）。\"},{\"para\":\"2. 保持一定频率的性生活\"},{\"para\":\"Pinzone 医生发现，一定频率的性行为（他特别强调了是性交而不是 DIY：）与维持健康的血压水平有关。另外，研究者还发现，性生活，包括抚摸、亲吻、拥抱等都能促进人体内多巴胺、内啡肽等的释放，让人感到愉悦，缓解压力带来的紧张、不适感（as cited in, Robinson, 2013）。\"},{\"para\":\"3. 尝试正念饮食（Mindfulness Eating）\"},{\"para\":\"压力会让人们对甜食或垃圾食品变得更有渴望（研究者认为，这可能与压力会大量消耗脑内葡萄糖有关）（Reisinger, as cited in Heaney, 2017）。临床医师 MichaelFinkelstein 建议，为了避免在这种渴望驱动下的暴饮暴食，你可以尝试“正念饮食”，它让你既品尝了食物也不至于“伤身”。\"},{\"para\":\"当你下次用“美食”给自己减压的时候，不妨尝试：\"},{\"para\":\"正念饮食方法，已被数据证明，可以非常有效的抑制压力带来的暴饮暴食问题。\"},{\"para\":\"4. 练习想象（Visualization）\"},{\"para\":\"在日常生活中，练习去想象更大的图景。你可以尝试（Gill, 2017）：\"},{\"para\":\"在这个过程中，你不再仅仅关注于眼前，原本让你倍感压力的事情和它带来的痛苦也都会显得渺小，变得可以承受，而你也会看到更多的可能性——包括未来生活的更多可能性以及实现目标的方法的更多可能性，并在这个过程中获得更大的意义感。\"},{\"para\":\"以上。自曝一下，压力爆棚的你是什么样的？有什么抗压方法？\"},{\"para\":\"原文发表于 压力过大的 10 种表现，你中了几条 | 如何科学地应对压力？\"},{\"para\":\"-\"},{\"para\":\"References:\"},{\"para\":\"Bergland, C. (2014). Chronic stress candamage brain structure and connectivity. Psychology Today.\"},{\"para\":\"Gill, B. (2017). New to Visualization? Hereare 5 steps to get you started. Forbes.\"},{\"para\":\"Heaney, K. (2017). When stress makes youfall asleep. Science of Us.\"},{\"para\":\"Lock, J.Y.,Campbell, M.A., & Kavanagh, D. (2012). Can a parent do too much for theirchild? An examination by parenting professionals of the concept ofoverparenting. Australian Journal of Guidance and Counseling, 22(02), 249-265.\"},{\"para\":\"Parker-Pope,T. (n.d.). How to be better at stress. New York Times.\"},{\"para\":\"Prevention(2015). 10 silent signals you’re too stressed out.\"},{\"para\":\"Putnam, L.(2015). Workplace wellness that works: 10 Steps to infuse well-being andvitality into any organization. Wiley.\"},{\"para\":\"Robinson, K.M.(2013). 10 Surprising health benefits of sex. Webmed.\"},{\"para\":\"Segal, J.,Smith, M., Segal, R., & Robinson, L. (2017). Stress symptoms, signs, andcauses. HelpGuide.\"},{\"para\":\"Seltzer, L.F.(2015). Trauma and the freeze response: Good, bad, or both? Psychology Today.\"},{\"para\":\"Schmidt, N.B.,Richey, A., Zvolensky, M.J., & Maner, J.K. (2008). Exploring human freezeresponses to a threat stressor. Journal of Behavior Therapy and ExperimentalPsychiatry, 39(3), 292-304.\"},{\"para\":\"SpiritualSelf-Help (2017). The four‘stress responses’, and how they shape your emotional reactions tolife.\"},{\"para\":\"Stress Stop(n.d.). Fight, flight or freeze response to stress.\"},{\"para\":\"「知乎机构帐号」是机构用户专用的知乎帐号，与知乎社区内原有的个人帐号独立并行，其使用者为有正规资质的组织机构，包括但不限于科研院所、公益组织、政府机关、媒体、企业等。这不仅是知乎对机构的「身份认证」，更是涵盖了内容流通机制、帐号规范等全套帐号体系。和个人帐号一样，机构帐号开通不需要任何费用，同时也受社区规范的监督管理，并要遵守相关协议。目前机构帐号入驻采用邀请制。您可以通过  什么是「知乎机构帐号」 来了解更多机构帐号信息。\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"还把情侣比作鸳鸯……你确定不是在骂人吗？\",\"content\":[{\"para\":\"文章来自机构帐号：中科院之声\"},{\"para\":\"“鸳鸯”在汉文化中，自古以来被誉为“夫妻爱情忠贞的象征”，受历代文人墨客的关注，成为爱情故事创作的主要题材。在我国古籍和诗、词、歌赋中多有记载。\"},{\"para\":\"您见过鸳鸯吗？在我小时候，最早是从家里印有成双成对鸳鸯图案的枕巾、搪瓷脸盆、窗花等物件上认识鸳鸯的。我们同时代的人，儿时家里或多或少都有一些印有鸳鸯图案的物件。\"},{\"para\":\"\"},{\"para\":\"在古代，人们关于鸳鸯的记忆应该更多且更为丰富吧！鸳鸯羽色艳丽、形态特殊，总是成双成对地出现在人们的视野中，呈现出不离不弃的样子，给人们留下了深刻的印象。所以人们就把它们和爱情扯上了关系，以鸳鸯作为夫妻恩爱的象征。\"},{\"para\":\"我做鸟类学研究工作之后，对鸳鸯的形态特征和生活习性才有了进一步的认识。发现旧物上无论是印的还是画的鸳鸯图案，与真实的鸳鸯相较都有很多的夸张和变形，甚至将雌鸳鸯画成了雄鸳鸯的翻版。而现实中的鸳鸯，雄鸳鸯的羽色鲜艳华丽，美得不可方物，雌鸳鸯的羽色却低调含蓄，整体呈灰褐色，眼周白色向后拖着一道细长的眉纹，就像江南的美女，婉约而不晃眼。\"},{\"para\":\"用画风来比喻，雄鸟似西方色彩浓烈的油画，而雌鸟似中国淡雅清秀的水墨画。不过如果你见过雄鸟的非婚羽，就会发现和雌鸟羽色相似。我想也许是应了《木兰辞》中的这一句“当窗理云鬓，对镜贴花黄”，当他蜕去了头部华丽的装饰羽及翅上的帆羽，拭去了浮华，也就成了她。\"},{\"para\":\"\"},{\"para\":\"鸳鸯：上雄，下雌（拍摄者：马晓峰）\"},{\"para\":\"一、爱情忠贞说的象征\"},{\"para\":\"唐代元稹《有鸟二十章》诗中云“有鸟有鸟毛羽黄，雄者为鸳雌者鸯”。在中国的传统文化中，自古以来鸳鸯就是一种充满爱情寓意的鸟儿，我自己最喜欢的描写鸳鸯爱情传说的句子，出自一首汉无名氏诗：“南山一桂树，上有双鸳鸯，千年长交颈，欢庆不能忘。”\"},{\"para\":\"不仅是文化人喜欢用鸳鸯来寓意美好的夫妻爱情，在民间民俗中也极喜欢用鸳鸯来作为夫妻恩爱的象征。\"},{\"para\":\"“鸳鸯戏水”已成为民间常用的艺术表现手法，在新婚喜庆的物品上，年画窗花中都能见到。古时布置洞房和使用的物件，也总会有它的身影，如鸳鸯房、鸳鸯灯、鸳鸯烛、鸳鸯被、鸳鸯枕、鸳鸯鞋等等，不胜枚举。用以寄托美好的愿望，祈盼夫妻能像鸳鸯一样成双成对形影不离、忠贞不渝、白头偕老。新时代的中式传统婚礼，被子和枕头上也通常绣上鸳鸯以示美好的爱情。由它衍生的词汇——如鸳鸯剑、鸳鸯扣、鸳鸯炉、鸳鸯锅、鸳鸯厅、鸳鸯阵、鸳鸯客等等，同样是不胜枚举，都带着点儿成双成对的意思。\"},{\"para\":\"但是，这一对碧鸟儿是否能担起如此的重任，实至名归呢？它们表示“压力山大”……\"},{\"para\":\"\"},{\"para\":\"中科院昆明动物博物馆馆藏标本\"},{\"para\":\"二、鸳鸯的爱情及家庭\"},{\"para\":\"鸳鸯为单配型的鸟类，即一雄一雌组建繁殖家庭，择偶配对，一般是在越冬地结群活动时就已经完成。3 月末 4 月初鸳鸯迁徙到繁殖地后，并不马上进入到二人世界，还要过一段集体生活，待天气渐暖后，才逐渐脱离群体活动进入营巢地，开启甜蜜时光。在此期间他们形影不离，成双成对，并肩在水中游泳嬉戏，交颈呢喃，亲密无比，就好似热恋中的情侣。\"},{\"para\":\"4 月下旬，小情侣们开始如胶似漆，纷纷进入交配的季节，一直会持续到 5 月中旬。整个交配过程是非常有爱的，画面唯美温馨，轻柔而浪漫。交配活动开始前，它们双双在水域中游泳，雄鸟频频向雌鸟曲颈点头，浸嘴于水中，同时竖起头部鲜艳的羽冠，伸长颈部，头时而左右摆动，随后它们并肩徐徐游于水面，并不时将嘴没入水中，游过一段距离后，雌鸟突然急速向前，雄鸟紧追其后，雌鸟同时不断地翘起尾巴，雄鸟紧接着跃伏于雌鸟背上，用嘴衔着雌鸟的头羽（保持身体平衡）进行交尾。雌鸟沉入水中，只将头露出水面。交尾时间每次约 2 秒钟，可连续进行 4-5 次。完成了这一神圣的仪式后，它们各自昂首展翅进行水浴并梳理羽毛，然后双双来到岸上休憩。\"},{\"para\":\"与绝大多数雁鸭类将巢筑于湿地草丛中不同，鸳鸯的巢大多筑于天然的树洞中，巢中除木屑外，还有从身上拔下的纤细绒羽垫窝，用于孵化时保暖。小家树洞的选址，是由雌雄鸟共同完成的。每窝一般产 7-14 枚卵，产卵之后的孵卵育雏工作，全部由雌鸟单独完成。雄鸟在雌鸟产完卵后，就离开雌鸟，到隐蔽地点换羽或集中在一起结成小群活动。孵化期约一个月左右，漫长而艰辛。雌鸟除外出觅食之外，一般不离巢，特别是在最后 1-2 天，小鸟即将出壳的关键时期，几乎终日不离巢，恋巢甚为强烈。在雌鸟觅食休息的时候，雄鸟有时会伴于她左右，也算一种精神上的抚慰和支持。\"},{\"para\":\"鸳鸯的雏鸟是早成性，刚孵出的小宝宝身上长满蓬松的绒羽，就像一颗小绒球，除了颜色斑纹略有差异，很像我们平时能见到的小鸭子。孵出后第二天就能凭借双腿、双翅和尾的平衡作用,从巢洞滑翔而下，落到地上或水中,进入水中后就能游泳和潜水，跟随亲鸟开始它们的生活。到了 9 月末 10 月初，秋风带来了一丝凉意，当年长大的儿女们和完成换羽的父母们又集群在一起，再次组成鸳鸯大家庭，离开繁殖地开始向南方迁徙。而在这一轮长途迁飞中，不知道有多少个体能完成这漫漫征途而存活下来，第二年再续写爱的篇章，延续生生不息的生命。\"},{\"para\":\"与大部分鸟类相同，鸳鸯的寿命并不长，基于目前的观察和研究，雌鸳鸯的寿命平均在 2-3 年，雄鸳鸯在 5-6 年，人工圈养条件下最长寿的记录是 15 年，放养条件下的记录是 11 年（英国）。若是某一方不幸死亡，另一方伤心几天，表达完哀思后也就去寻找新的配偶了，并不会为对方“守节”。\"},{\"para\":\"三、有情或无情，忠心或移情，这是个问题\"},{\"para\":\"我们一起再剪影似的脑补一下鸳鸯的爱情生活及家庭生活，对于鸳鸯到底“有情还是无情，忠还是不忠”，元芳，你怎么看？\"},{\"para\":\"动物的婚配制度是在进化过程中产生的，与自然选择密切相关。它作为一种行为策略，在动物繁殖过程中具有重要意义，种群中大多数个体采用的行为方式必定是繁殖成功率最高的策略。鸳鸯是单配型的鸟类，具体说应该属于保卫雌性型一雄一雌制，雄性个体一般不参与抚育后代。这种情况往往是由于不必保护领域资源、雄性个体较多、性比失衡的原因。\"},{\"para\":\"一些研究结果显示，鸳鸯不管是成年个体还是第一年的个体，雌鸳鸯的存活率都比雄鸳鸯低，使得性比失衡，雄鸟找媳妇儿困难，求偶炫耀的竞争非常激烈。这也是为啥雄鸳鸯颜值如此之高，而雌鸳鸯如此低调朴素的一个原因。所以它们在繁殖前的几个月就已订婚，雄鸟保卫爱护雌鸟，绝不允许第三者插足，直至产卵，产卵后一应繁杂劳心的家务事儿就都归雌鸟了，好似单亲妈妈。但第二年是否还是我们俩，那就，再说了，呵呵。\"},{\"para\":\"所以，事实上鸳鸯并不似传统意义中那般忠贞和专情——你的眼里一生只有我。一方死亡，另一方也不会为其守节。但传统文化中鸳鸯的这一象征角色，也只是人们看到成对的它们在静湖碧波之中的亲昵举动，通过联想产生的美好愿望，是人们拿来寄托对美好爱情向往的一个载体，在历史长河的流淌中也给予了人们太多美好的遐想和期冀。一边是自然生存繁衍的法则，一边是中国的传统文化，非要断出个所以然，感觉没什么意思也没有必要，本就是两个截然不同体系里的东西。不如把鸳鸯古老纯真爱情的传说作为我们个人感情世界里的明灯，向往之努力之，朝着幸福出发吧！\"},{\"para\":\"作者：刘鲁明\"},{\"para\":\"来源：中国科学院昆明动物研究所\"},{\"para\":\"「知乎机构帐号」是机构用户专用的知乎帐号，与知乎社区内原有的个人帐号独立并行，其使用者为有正规资质的组织机构，包括但不限于科研院所、公益组织、政府机关、媒体、企业等。这不仅是知乎对机构的「身份认证」，更是涵盖了内容流通机制、帐号规范等全套帐号体系。和个人帐号一样，机构帐号开通不需要任何费用，同时也受社区规范的监督管理，并要遵守相关协议。目前机构帐号入驻采用邀请制。您可以通过  什么是「知乎机构帐号」 来了解更多机构帐号信息。\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]},{\"title\":\"大误 · 皇上，这可是宝贝啊\",\"content\":[{\"para\":\"准备工作(๑•̀ㅂ•́) ✧\"},{\"para\":\"1.买几包水晶宝宝（或者说泡大豆），就是你上小学的时候玩过的那种。\"},{\"para\":\"一包 500 粒，只要 0.1 元。\"},{\"para\":\"\"},{\"para\":\"2.还有鱼缸造景用的荧光砂\"},{\"para\":\"淘宝一个一毛。\"},{\"para\":\"\"},{\"para\":\"3.玻璃弹珠，三个一元\"},{\"para\":\"买三个就够了，用途后面会讲。\"},{\"para\":\"4.五瓶风油精\"},{\"para\":\"5.随便打印一份地图，芬兰瑞典挪威冰岛丹麦随你选，魔兽地图也行。\"},{\"para\":\"6.打印出一份详细的大事年表，除历史事件外还要记录地震等灾害的时间地点，并打印出历朝历代所有皇帝的出生日期。最好缩印。\"},{\"para\":\"7.阿司匹林，你值得拥有\"},{\"para\":\"一盒 14，多备几盒。\"},{\"para\":\"8.手纸\"},{\"para\":\"9.纯净水\"},{\"para\":\"10.一次性打火机\"},{\"para\":\"11.衣服穿厚些，短袖上套长袖，长袖上套羽绒服，羽绒服上套羊毛大衣。\"},{\"para\":\"一定要穿秋裤！\"},{\"para\":\"12.大纸箱\"},{\"para\":\"13.玻璃碗\"},{\"para\":\"14.刻个橡皮章\"},{\"para\":\"穿过去之后(๑•̀ㅂ•́) ✧\"},{\"para\":\"1.如果天气热，把羽绒服长袖大衣秋裤之类的脱掉并装箱。（冬季跳过）\"},{\"para\":\"2.看看自己到了哪个朝代，把与此朝无关的史料烧掉。\"},{\"para\":\"3.用水将大部分泡大豆 / 水晶宝宝 / 海洋宝宝（即图一）泡发，装至玻璃碗中。\"},{\"para\":\"记得给自己留几颗。\"},{\"para\":\"4.声称自己是 xx 国使者，要求进宫面圣，有印章为证。\"},{\"para\":\"国家名字可信口胡编，切记不能是太近的国家。\"},{\"para\":\"5.面圣后，献上之前打印的 xx 国地图，并将玻璃碗中的泡大豆献给皇上。\"},{\"para\":\"花言巧语，可自行发挥。\"},{\"para\":\"例：长安以东三万里曰子虚之山，其状如扇，临于荒海之上。山中有湖，湖中有奇蚌，其名曰乌有蚌。每逢盛世，奇蚌吐珠，珠华四照，其名曰软玉。\"},{\"para\":\"除此之外，也可以把泡大豆说成鲛人之泪 / 神鱼之卵等。\"},{\"para\":\"6.献风油精\"},{\"para\":\"例：又西北四百二十里，曰 x 山，其上多青木，其味如饴，食之不饥。剖树取汁，得琼浆。其色碧绿，有异香，可驱蚊虫，君子服之，以御为祥。\"},{\"para\":\"7.带上皇帝赏赐的银两，在京城里住下。在未来的皇帝降生的前一天再次进宫，告诉皇帝自己的泡大豆（软玉 / 鲛人之泪 / 神鱼之卵）在今天变成了碧玉，这是天降祥瑞。\"},{\"para\":\"并将荧光砂和玻璃球献给皇上。\"},{\"para\":\"次日皇子（即未来的皇帝）出生，现任皇帝也许会认为你有神力，能当个御用风水师啥的。（哪有这种官啊！摔！）\"},{\"para\":\"8.在皇帝 / 后妃 / 皇子患病时入宫，声称自己能用法术治好病。\"},{\"para\":\"烧张符，加入放了阿司匹林的水中，让病人服用。\"},{\"para\":\"病愈后，皇帝对你并将更加信服。\"},{\"para\":\"（这一条风险很大，万一病没好......）\"},{\"para\":\"9.在地震到来的前几天，声称自己夜观天象，某某某处必有大灾。\"},{\"para\":\"之后可一直走神棍路线，保你一生荣华富贵。\"},{\"para\":\"实在是编不下去了 Orz……\"},{\"para\":\"-\"},{\"para\":\"完\"},{\"para\":\"我就是开了个脑洞而已啊இAஇ\"},{\"para\":\"客官，这篇文章有意思吗？\"},{\"para\":\"好玩！下载 App 接着看 (๑•ㅂ•) ✧\"},{\"para\":\"再逛逛吧 ˊ_>ˋ  \"}]}]//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///249\n");

